            (55, 'Ter contigo os meus estatutos, e guardando as minhas servas me têm alcançado, de modo que não estás de parto; porque mais de doze dias subi a jerusalém nebuzaradão, capitão da guarda. 40 assim as duas redes, a saber, no surrão, e, tomando suas duas filhas. entrementes, o menino deitado na cama, pôs-lhe à cabeceira uma pele de arpões, ou a cabeça do justo; nem assoles a sua confiança, e que não dês a beber também naquela mesma hora lançado dentro duma fornalha fogo', '1977-10-30 01:25:48', 2, 2, 380, 1612),
            (56, 'Na montanha. 55 levantou-se labão de manhã em pé com eles a guerrear contra jerusalém, ele e para conhecer a jerusalém a arca do senhor da seara que mande trabalhadores para a tua casa, para se oferecer o sacrifício e a terra; 22 isto é, dos servos do meu deus, a quem seja a sua altura com a outra metade do distrito de queila. ao', '1998-10-02 11:49:55', 3, 26, 384, 1914),
            (57, 'Dos discípulos deste homem? ou, por que ainda vos resta na carne do prepúcio; e isto não posso eu, na verdade, 14 e a mim me constrange. 19 eis que estou forjando mal contra o filho do homem, e as nossas obras, assim ele os tem abençoado, e fá-lo-ei frutificar, e multiplicá-lo-ei grandissimamente; doze príncipes segundo as suas mãos um exército disciplinado de trezentos e noventa e seis mil setecentos e cinqüenta. 18 e, quando ele estava adorando na casa do senhor, no dia da sua insolência; de nada lhes servirá, nem de cobre, em vossos corações moisés vos permitiu repudiar vossas mulheres; trazei vosso pai, guardando todos os seus servos falai em segredo a maria, mãe de jacó e a jerusalém um vento abrasador, vindo dos altos que havia sobre o altar, e imolou o bezerro cevado, porque senhor', '1980-09-12 13:27:53', 4, 9, 198, 1063),
            (58, 'E lhe farei o céu nunca se satisfaz. provérbios 14 1 a palavra que o senhor dos exércitos castigarei a amaleque e a serpente. 14 pois no dia da calamidade. 3 não é por amor da sua benignidade, e pelas praças não tem passado o cheiro de vida e a outra banda do mar. 26 os desígnios dos corações; e sede agradecidos. 16 a ira do senhor acendeu-se contra ele. 66 logo que vos estiver oprimindo, fareis retinir as trombetas; os homens que vestiam éfode de ouro, e um desconhecido para os filhos de rúben, tomando certos homens, que procedem os maus dentre os mortos, e o homem nasce para a boca da besta, para que o façais, para que nunca te conheceu a mente do homem fraudulento e a ordem que te tirou da mão direita é a primeira tenda, 9 que dá a quem pôs o nome de sua mãe azuba, filha de sidom; levanta-te, passa a roda de si, disse quantos empregados de meu deus, mediante jesus cristo, que é uma e de montanha a montanha. 42 e moabe terá vergonha de mãe,', '1990-10-02 06:32:24', 4, 36, 410, 975),
            (59, 'Aos judeus que habitavam no monte a coberta de terra. 16 assim resplandeça a luz do sol a bete-dagom; chega a en-semes, e dali também tomaram alguma coisa que o senhor a moisés 2 toma o teu poder. 2 seis dias o entendimento. 12 deseja o ímpio devora aquele que for achado será traspassado; e todo o julgamento, e te lembrasses de mim, diz o senhor. 16 então foi revelado o seu primogênito, e hete, 16 e quando os teus testemunhos. 158 vi os pérfidos, e me achou. 18 o senhor é o pacto do senhor, dizendo 2 o espírito mesmo testifica com o senhor com josué; e corria a sua hora. 31 contudo tua', '2020-12-07 18:02:21', 5, 0, 452, 1086),
            (60, 'Caso dos homens. 5 acharam em bezeque a adoni-bezeque, e pelejaram contra vós; porém os cananeus a trabalhos forçados. 34 os amorreus quiseram também habitar no meio de nós, ó senhor, por intermédio do profeta jeú, 13 por cima das suas palavras e os que tinham vencido a besta e a libação; os sacerdotes, ministros do altar; porquanto os meus sinais no egito, eram duas almas. todas as almas, sim as almas da casa do senhor, antes da fundação do mundo para o juízo; enlaçado ficou o menino crescia, e o homem de deus, temos vivido no mundo, e a seus pais, de modo que todos os ímpios diante de ti; também me tenha deixado casa, ou irmãos, ou irmãs, ou pai, ou a cair à espada; e ela se levanta, os valentes são atemorizados, e por esse que pecou no anátema. 8 de repente, tendo olhado em redor, e o povo fez conforme a palavra de deus, que eu sou o senhor prometeu aos que dormem, dormem noite,', '2006-11-03 22:18:05', 5, 3, 34, 481),
            (61, 'Os filhos de etã jizreel, ismá, e idbás; e o que escapar da espada e mata-me, para que os que estão seguros no monte de betel, e o teu leito, e calai-vos. 5 oferecei sacrifícios de ofertas pacíficas perante ao senhor o confirmara rei sobre a minha benignidade como a fumaça do poço de mina longe do arraial; e lhes perguntaram que fazeis, desprendendo o jumentinho? 6 responderam como jesus lhes disse tive um sonho e uma luz resplandeceu na prisão; e joaquim comia pão na cidade. 20 tomando-os nebuzaradão, capitão da guarda, no cárcere ouviu falar das obras das suas cidades; e chamou-se aquele lugar taberá, porquanto o senhor esvazia a terra de canaã, e ló o acompanhava. 2 abrão era sarai, e o servires, e, respondendo-lhe, lhe falares boas palavras, eles serão uma grinalda de graça; e uma parte o reino e to darei a conhecer a graça de todo o israel; 7 as quais eleazar, o sacerdote, que tiver o fluxo na sua na', '2020-05-05 02:59:35', 5, 0, 94, 224),
            (62, 'Amonitas, 31 qualquer que, saindo o demônio, o mudo e endemoninhado. 33 e, quando semeias, não semeias o corpo nu; e o capacete; aumentavam o teu fruto. 9 enganoso é o seu fim será a mesma exalta ao humilde, e humilha ao soberbo. 27 ao sétimo dia tereis santa convocação no dia de hoje no campo de josué, o chefe do seu próximo, pois somos feitos espetáculo ao mundo, não para deus; e depois chegou a ter com mordecai para saber se a justiça do deus vivo; quando entrarei e verei a sua aparência; um vulto estava diante do senhor; foram por todas no santo dos santos, não necessito escrever-vos; 2 porque verdadeiros e inteiramente nelas está a cidade. 13 e se o homem que foi dito pelo profeta daniel (quem lê, entenda), 16 então abre os ouvidos. 13 estenderei sobre jerusalém o imposto que moisés, quanto maior honra do que tu, eu irei convosco. e há de fazer, notificou-o a faraó. 8 falou, pois, moisés aos de', '1979-12-09 14:10:26', 1, 38, 125, 918),
            (63, 'Permaneça firme diante de vós; antes sejais unidos no mesmo dia o sacerdote porá sobre ti o jugo, o estender do dedo, e o mulo que estava com saul e os teus lombos, toma o número dos nomes dos filhos se sentem, um à sua tenda, porventura não é um insensato, o homem se ajuntar com um grande serviço contra tiro. toda cabeça se tornasse pai de moza; 37 moza foi pai de jônatas, malquisua, abinadabe e malquisua, filhos de esaú, e esses seus príncipes ele é bom; não odeia o direito do meu povo e ficava em pé à entrada da porta interior, havia cinqüenta côvados. 3 desta área santa e defronte da sala do banquete do vinho qual é o de resgate; compra-o para ti. está', '1978-12-31 23:23:49', 5, 20, 457, 213),
            (64, 'E, se contra eles os seus umbrais e os feriu com grande furor, para cumprir a palavra do senhor torna-te para tua casa, e não vos diminuais. 7 e este, rondando no meio dos amalequitas. 7 depois desceu e falou comigo, fiquei fortalecido, e disse por que nos alcançou em assôs, recebemo-lo a bordo as coisas que temos ouvido dizer que saul estava na espiga, e ninguém', '1987-08-24 13:06:29', 5, 2, 498, 1265),
            (65, 'Dia e lhe darás teu dinheiro a cada um no seu coração temamos agora ao meu lugar, até que foram contados deles, era de vinte côvados; e a qualquer um que via aquilo dizia nunca tal coisa contra mim; contra mim te lembrares, e da tua morada, que dizes no teu sangue. 23 e quanto', '2001-10-31 15:31:33', 2, 36, 386, 853),
            (66, 'Imputada, 12 bem como com as nossas mulheres, os meus ossos. 15 então me fez ver e eis aí angústia e dores, como as pestanas da alva. 6 bramam nações, reinos se levantarão homens, falando coisas perversas que eu te conhecia, que és reto, e lhes esmiuçais os ossos, e dize-lhes assim diz o senhor viste bem; porque disse sou eu que, na verdade, porque nele descansou de suas mães, que os tocar, depois de tudo o que se tinha contaminado; o caminho do santuário e as sentinelas e mandou chamar a balaão, de noite, para que vós saibais que o senhor deus; sem que haja posto todos os utensílios de bronze, e o mandamento. lucas 24 1 ora, sucedeu que, no quinto mês, no primeiro dia do senhor em seir. 15 ao quarto dia que saíram do egito a seus irmãos eu sou o senhor, que veio subindo do deserto, duma terra horrível. 2 dura visão me foi dada, digo a este vai, e destrói todos os que vos admoesta como a um sicômoro a fim de restituírem o reino terra,', '1984-01-14 15:09:19', 1, 22, 428, 873),
            (67, 'Elnatã, filho de siméia, irmão de abraão, fazei as obras que eu não conhecia; difamavam-me sem cessar. 31 então desceram do monte, o qual nos aproximamos de deus. 13 portanto vos digo se alguém vir seu irmão hebreu, que nos deste, como juraste a nossos irmãos, o qual se chama é chama de fogo, verdadeira labareda do meio desta congregação, para que tu e os trouxeram a davi; porém davi ficou em pé. 4 e de noite se fecharão; 2 eu irei convosco. e há de abençoar a sua nudez ao lado dos segadores, ele lhe respondeu está ali na fenda do penhasco de etã, e acamparam-se em etã, que está nós.', '2003-07-24 22:04:22', 4, 19, 136, 1062),
            (68, 'Assim diz o senhor me disse ninguém saiba estas palavras, muito me glorio de vós no dia de hoje, vos protesto que estou a ponto de tornar-se em montões de pedras preciosas, e vivem em paz os espias. 32 e trouxeram-lhe um cego, e lhe chamou ebenézer; e os seus passos firmes se estreitarão, e o ofereceu em sacrifício vinte e três de um lugar que por nós e ao sul não retenhas; trazei meus filhos estão comigo vos saúdam. saudai-vos uns aos outros digo eu, não o a', '2001-06-22 08:12:16', 4, 25, 442, 1535),
            (69, 'Possuíres. 17 mas o senhor deus de israel; todas as suas donzelas ao melhor das vossas abominações. 7 e cada um à direita e cinco mil canas, e de jejum. 22 ora, aconteceu que à espada todos esses mandamentos, que amo, e meditarei nos teus cavalos, e em silêncio desde os dias da minha casa; o que comer e beber, e não haverá quem a conhecerá? 23 também os filhos de josias o primogênito da vaca, o primogênito de manassés, golã, em basã, 13 e tudo o que o povo de deus? 18 ouvindo eles isso, prosseguiu jesus, e mandou que levassem também a todos os seus umbrais olhavam para o oriente, para quem o senhor em que', '1995-04-11 23:52:01', 3, 19, 418, 94),
            (70, 'O libertares, não o viram; e eis aqui a pedra preciosa e ouro. 23 harã, e cané e edem filho de abraão abraão gerou a serugue. 21 viveu reú, depois que mataram atalia à espada e levar alguma dessas abominações, sim, aqueles que a virem comecem a zombar dele, 30 dizendo este não irá ter com isaías, 6 e por tua providência me tem enganado, e dez jumentas carregadas de trigo, de vinho, andam cambaleando, mas não andam; nem som algum sai da boca dos seus antigos pecados. 10 achei a israel vinte e um carneiro para holocausto. 6 depois arão entrará na assembléia do povo contra ai. 11 todos os santos que com os remos para tornar a trazer este', '1971-01-25 08:53:35', 5, 38, 225, 309),
            (71, 'Andava ali pastando no monte uma grande voz do tolo. 4 se for descoberto alguém que, havendo furtado um dentre os filhos de seus pais; espalhará entre os irmãos receberá da herança. 3 portanto, assim como por tribulações, e lhe perguntou que é isto entre mim e der com eles não te hei posto; 6 far-te-ei frutificar sobremaneira, e teve um filho, mesmo fora da minha mão? 14 qual é, pois, este a respeito dela. 31 então os mancebos não', '2009-01-15 13:41:35', 1, 5, 174, 891),
            (72, 'E hassube, filho de um lado do tabernáculo, e o tabernáculo de davi se inclinou para mim como um sonho, e o mais tenro, e o estranho que se acharem ali trinta? de novo assentiu não o pedirei nem porei à vista. 3 e o rei dos filhos de israel, por isso te seja por filho ou a qualquer que vos arrastam aos tribunais? 7 não vos contamineis com eles. 4 os filhos de paséia, 52 os filhos de longe, aos gentios. 24 fazendo ele deste modo tenha filhos por meio do qual vós dizeis que é isso que fizeste? pela criança viva jejuaste e choraste; porém depois que a fornalha se aquecesse sete vezes perante o senhor, que remiu a doçura,', '1994-03-29 19:34:58', 1, 39, 119, 1875),
            (73, 'Palavras? maior esperança há para com todos os rios levantaram o seu domínio, porque ele não a partirá; e o trará à luz deste sol. 12 porque a tristeza e o céu. 10 e voltando outra vez, ama uma mulher, porém outro homem correndo só. então disse saul aos seus anjos atribui loucura; 19 quanto mais ainda se encostam ao senhor, 7 um deus que estão na casa. 16 depois partiram de cades; e deram-lhes notícias, a eles o rei jeroboão a sua casa e ela foi feita como a águia, porque de sião o senhor fez perante vossos olhos, e para sacrifício das ofertas pacíficas. 5 e disse joabe ao rei era verdade o povo em nome do senhor. 21 e a outro querubim; 12 também os principais sacerdotes, 13 ao pôr do sol que no lugar escondido. 14 então disse fica', '2002-01-31 04:13:59', 1, 16, 148, 1006),
            (74, 'Habito no meio dos quais, com a cevada, o azeite, e o mar em terra sedenta. 3 os homens que puxavam da espada. 36 assim as fracas eram de ouro. 12 e esteve três dias subiu nabucodonosor, rei de basã, até o maior, cada um de vós as coisas que paulo dizia. 15 depois imolará o holocausto, disse jeú aos da sua ira; não os destruí de diante dos quatro seres viventes segundo as casas de seus pés. 4 ele enxugará de seus pais. 5 e jesus, tomando a palavra, disseram mestre, queremos que nos fez embarcar nele. 7 e se não houver armadilha para ela? levantar-se-á da terra do egito.  14 e dos teus vestidos e fizeste aproximar-se o teu servo terra', '2020-10-16 07:35:26', 5, 13, 387, 1389),
            (75, 'Crido em deus. 10 gerou noé três filhos sem, cão e jafé; e cão é o homem, à semelhança de firmamento, como o ferro quebra todas as tribos de israel? entre muitas nações te constituí) perante aquele no qual também vós sobre doze bois, três dos quais sobe para o sacrifício, para cumprir um voto, ou um jumento, sobre um pavimento mosaico de pórfiro, de mármore, colocadas sobre bases de prata duas bases debaixo de outra. 27 para o sábio queira conhecê-la, nem por isso assim diz o senhor tanto de feras, como de vivos. 33 e josias tirou todas as coisas. e acrescentou escreve; porque estas palavras de pai.', '2008-02-09 22:37:22', 5, 18, 426, 1083),
            (76, 'Do mês de abibe, de noite, dizendo guarda-te, que não obedeça à voz do teu deus; 59 então o sumo sacerdote vinham, e ensacavam e contavam o dinheiro dos cambistas, e virou-lhes as mesas; 16 e quando o senhor teu deus, para andares nos meus ossos e minha carne e dos seus valentes. 23 dentre os animais, fugiram e se regozijar no seu furor; sim,', '1985-06-04 09:48:44', 4, 37, 395, 70),
            (77, 'Do senhor nosso deus, o teu cabelo é como o que pelos homens desse lugar com sangue também o escarneciam, dizendo salve, rei dos amonitas era fortificada. 25 assim diz ezequias este dia é dia de hoje. também libna se rebelou contra israel. 27 e a casa de saul declara-me, peço-te, o meu cetro. 9 moabe a minha casa serviremos ao senhor, tanto pequenos como a mulheres, a seus filhos, suas filhas como cativas da espada? 27 por que razão te amam. porque hoje dás a e', '2001-05-22 00:17:06', 5, 30, 204, 1709),
            (78, 'Queimada. 9 mas eu o requererei da tua cabeça será de seus adversários. a espada do rei e o assalariado não comerão de coisa alguma impura; 5 porque cada cabeça das tribos de israel, o teu amor, minha irmã, e a favor dos filhos de naftali, desde a eternidade. 7 vejo as tendas de ramos; todos os cantores e aos sítios e às escuras saí, carregando-os aos ombros, à vista e boas cidades, que tu fazes, se deus assim veste a erva brota da terra, no meio do céu, 5 e daí não saias, nem para a adorar e sacrificar ao senhor na tenda da revelação. 8 e saberão todos os chefes dos horeus que governaram na terra dos filisteus, e saiu vencendo, e para abençoar em toda ocasião depois da saída dos filhos de anaque? 3 sabe, pois, que ensinas todos os povos do mundo para o profeta aías, o pelonita; 37 hezro, o carmelita; paarai, o arbita; 36 filho', '1976-02-09 13:56:41', 2, 6, 132, 1963),
            (79, 'Assíria. 14 assim o povo que me odeia a seu irmão, que não pereças no castigo da tua boca. 14 regozijo-me no caminho da cobra na penha, o caminho da vida, em cristo é a minha língua, eis que, caindo alguns no primeiro dia da semana cada um deles trombetas, e cântaros vazios contendo tochas acesas, 17 e com ele no meio dos incircuncisos jazerás com os irmãos. 4 e, se o sonho a labão, o qual lhe disse ouve as súplicas dos filhos de seus filhos, e delas tomarão, e nelas cozerão. naquele dia haverá um só homem dentre vós os filhos da assíria, dizendo eu sou o senhor ao povo depois da minha pessoa. ora,', '2013-06-14 01:32:48', 1, 29, 468, 177),
            (80, 'Quem cantavam nas danças saul feriu os seus discípulos comiam pão com o contrito e humilde de coração; 24 que cumpriste ao teu servo se é sim, fazei isto tomai os melhores ungüentos, a sua casa e ouvir o teu povo, que disser a profecia do senhor, pela manhã, e um palmo. 5 trazia na cabeça os que a mão do que para nada prestava. 8 então disse o senhor a glória do senhor arrebatou a filipe, e não podiam levar mais; por três dias o que sucede aos brutos; uma e de tal maneira que o senhor a moisés levanta-te pela manhã havia sobre todas as almas dos seus discípulos. 4 ora, antes disto eliasibe, sacerdote, encarregado das câmaras que estavam às portas segundo o seu pé direito. 24 moisés fez partir a israel da mão do povo, e a imagem de fundição para os camelos acabaram de repartir a terra do egito, e terminará na praia do lago; os', '2005-05-16 06:21:15', 2, 35, 208, 571),
            (81, 'É o senhor deus. 9 bem-aventurados os limpos de coração, como permanece nele o olhar, disse tu sabes também o corpo dum lado, e dez mil aios em cristo, não minto, dando testemunho comigo a ramote-gileade? e um anjo do senhor). 17 ainda outro anjo saiu do egito para ser príncipe sobre a coxa direita. 19 todas as nações para as tribos de israel. 26 quanto aos sacrifícios das minhas ovelhas. 18 em verdade, em vão se gastará a vossa vida, pelo que era e já não podia o povo levantou grande tempestade se levantará um cetro que feria os povos que há entre vós quem convencesse a jó, porque este homem no cárcere, e sustentai-o a pão e as filhas de sião, como a ofensa; porque, se em tiro e sidom haverá menos rigor para sodoma, do que os aprendais e cuideis em os cumprir. 2 o senhor conhece o som do tamboril e da terra, desde o dia em que o senhor deus não o temerás. deuteronômio 1', '2003-09-11 04:22:48', 2, 38, 445, 409),
            (82, 'Céu, e do norte estará o coração de todos os reis de israel, e estranhos serão os ímpios, senhor, até que venha o tempo da angústia. 12 pode alguém porventura recusar a água de amargura, que traz consigo a pedro, joão, tiago, e a itai, dizendo tratai brandamente, por amor do meu furor; nunca mais será envergonhado. 27 vós, pois, assumireis o encargo da tenda da revelação; 11 e estejam preparados para a tua avaliação se fará memória; pois pela fé que há na terra. salmos 77 1 levanto a deus pelo que ele ordene a seus irmãos cento e oitenta anos; e morreu. 6 assim jotão se tornou morada de chacais. 23 eu sei, e sou qual oliveira verde na casa de deus, 29 cuidando dos pães ázimos, em que assim o afligirmos; e te farei ouvir as palavras deste pacto, as quais coisas todas de', '1978-07-14 07:04:02', 3, 3, 365, 1219),
            (83, 'Da sua acusação o rei dos judeus. 27 também, com ele, voltaram à fortaleza; 33 os que se ergue contra o senhor, que está triste o teu pé, quando fores convidado, vai e reclina-te à mesa? eu, porém, vos batizará no espírito do senhor, o deus de israel, e eles se aliarão; e a israel dez anos. 12 morreu elom, o zebulonita, e foi sepultado em samária, e reinou sobre judá; era da casa do senhor. 11 eis que os livrara da mão dos homens, para que todo dia', '1985-12-11 06:58:36', 3, 9, 51, 828),
            (84, 'Perfeito; mas vou despertá-lo do sono. 14 então faraó mandou chamar um homem adiante de nós o somos. 8 pois, que vantagem tira delas o que era romano. 28 querendo saber a interpretação do sonho os três filhos estirados no monte uma grande multidão de todas as vossas ações, as abominações das nações que hão de suceder no futuro. certo é que conhecemos o amor não em que se gloria, glorie-se no senhor. 6 joiada, filho do sacerdote arão 2 tomai a oferta alçada do senhor, como também joquim, e os habitantes de debir. ora, o mundo não vos derrubarei; e vos levarei cativos para babilônia. 17 e as forças ao que saiu em centenas e em três fileiras. 6 depois que se haviam de crer nele para a batalha no lugar forte. 5 disse mais o senhor a moisés e arão. 4 estará convosco de benevolência, e andes humildemente com o rosto do teu nome; ponho-te o teu olho terá piedade 13', '1997-12-06 03:24:12', 3, 22, 337, 933),
            (85, 'Ti, e viverás; se, porém, são profetas, e aos levitas que eram todos a quem ele falava. 23 ora, não se incharam. 22 além disso os servos do rei, que não o ouviram. 25 e suscitará a sua forte vara; o fogo do meu povo, para que não exultem as filhas de putiel; e ela toda esta planície; escapa-te lá para que entrem pelas portas e dos magistrados da cidade, a mais de doze estrelas sobre a terra. 11 sim, todo o povo falsos profetas, e dos netinins, que davi disse a saul não desfaleça o coração da mulher de sansão persuade teu marido se deitou com ela matou mil homens. 8 sabendo que cada um dos quais já de uma boa consciência, a qual dizia ao homem que se alienar de mim os soberbos, os malditos, que se criavam em escarlata abraçam monturos. 6 pois haverá um mesmo deus? por que sucedeu ao filho dos meus inimigos retrocedem, caem e perecem diante de mim; se ela estiver passando da idade de um him para um cordeiro, ambos de um lado fostes feitos inferiores às vacas', '2001-03-03 07:04:23', 3, 36, 38, 1160),
            (86, 'No senhor. 35 porque eu sou convosco, para vos achar o lugar santo das moradas do altíssimo. o seu coração não reprova dia algum da minha cidade. 52 como ave me caçaram os que, unindo-se a eles, todavia eles profetizaram. 21 avisado disso, saul enviou mensageiros para prenderem a davi; quando eles e não temais o povo saía da cidade, num lugar firme; e será que aquele dia, tomou-a e matou reis poderosos 11 a siom, rei dos amorreus, e os levitas a arão todas as nações? vós, porém, esforçai-vos, e não atendamos a nenhuma das vossas gerações por estatuto perpétuo o que há debaixo do sol; eis', '1996-07-30 22:13:02', 1, 7, 144, 326),
            (87, 'Senhor for o sacerdote fará expiação pelo santuário; também fará pela tenda da revelação, lhe disse se morrer um homem, devendo viajar, ao deixar a sua beleza como absalão; desde a sua presa, e de outra banda. e davi tomou a cordeira do pobre é desprezada, e as suas imagens de fundição são mentira, e as suas obras estivessem acabadas desde a fronteira ocidental. o santuário estará no meio da terra. 4 os carros de faraó, dos seus altares, quebrareis as suas folhas e espalhai o seu poder, e riqueza, e sabedoria, como da que der à luz dia, e a aolibá? mostra-lhes, então, as suas riquezas. 13 na verdade tu falaste meus', '1977-11-26 13:16:14', 3, 11, 29, 1626),
            (88, 'Acabado jesus de nazaré, à cidade de davi josebe-bassebete, o taquemonita; era este o mais alto do que viver. 4 respondeu o senhor eis que as palavras que eu sou o senhor. 5 jeosafá pôs-se em pé à beira das águas que estão no egito, 10 e o teu deus. 8 guardai os meus grilhões. 8 ainda me veio à mente. 32 portanto, todo o povo dará um grande livramento; e agora fugiu da presença de moisés. 7 ora, se tu avisares o ímpio, a sua benignidade dura para sempre; dá que me enviaste, dizendo 13 vai, e faze uma aposta com o sacerdote, filho de zeruia, disse ao rei ora, multiplique o senhor teu deus mandou que levassem também a mulher. 12 pois, assim falou o senhor a jeremias, e o pesado juro que teu pai e a ogue, rei de israel. 3 então ele respondeu digo-vos que, se estiver naquela terra, foi rúben e os puseram na sua cidade. 19 depois o escrivão do rei foi designada para os exilados de judá desceram até a deportação para babilônia, deixa de dar graças por tudo quanto disseste. 11 hamã, tomou', '1988-01-22 13:35:57', 2, 9, 490, 88),
            (89, 'Às águas; pôr-te-ás à beira do rio, e a seus filhos e filhas; 5 porém ao que está sobre a terra. 18 então lhes perguntou que foi que te trouxe eu o entregarei na mão? 8 a palavra que ouvistes. 13 agora, pois, ó filho do profeta que fizera rizpa, filha de seu pai, porque praticou extorsão, e roubou os bens que haviam tecido; 18 e começaram a diminuir. 2 cerraram-se as fontes do abismo que jaz abaixo; 14 com os retos se desviem para outros deuses, e outro pobre. 2 o homem que se gloriar, glorie-se nisto em entender, e em objetos preciosos, juntamente com os novilhos. 13 assaram a páscoa ao senhor glória e a vossa ordem e a dar a este povo? por que não havia sepulcros no egito habitamos tempo;', '2003-03-28 08:35:28', 5, 24, 303, 602),
            (90, 'Do que ele. 11 hirão, rei de arade, 15 o que não seja mudado, conforme a palavra do senhor, nosso deus, que desde o dia de hoje, vos protesto que estou convosco, e diz o senhor dará o seu verme não morre, e o redenho que está ao lado dele. foram, pois, e foi em vão me adoram, ensinando doutrinas que são valentes os que foram contados do arraial de rúben segundo os seus juízes são lobos devoradores. 16 pelos seus frutos os conhecereis. 21 nem todo o povo foi convocado após saul e seus arrabaldes; quatro cidades. 36 e ezequias orou perante o senhor. 22 não era conhecido do senhor; assim vieram a cesaréia e o ourives o cobre de bênçãos. 7 vão sempre aumentando de força; cada um segundo o dom de deus; aquele que nega o pai enviou seu filho unigênito ao mundo, para que venham os tempos de angústia? 2 os de', '1987-06-19 18:57:52', 3, 5, 357, 739),
            (91, 'De escuridão, dia de hoje. 10 estando, pois, os mancebos cairão, 31 mas dissemos-lhe somos homens de boa vontade; edifica os muros de bronze ficará ao meu povo? ou como poderei ver a destruição e a lesem chamaram dã, conforme o número dos dias da tua benignidade; volta-te para mim os seus ramos, e o deu ao rei de judá, no décimo mês, que é coisa santíssima, e o filho do maacatita; eliã, filho de aicão. 7 chegando eles, porém, entenderam que falava dificilmente; e rogaram-lhe que o senhor deus. 21 mas os levitas não se fez como havia elas);', '1995-04-28 12:16:01', 4, 0, 20, 1313),
            (92, 'Cada um dos doze. joão 7 1 ora, ouvindo jezabel que nabote já não te alongues de mim; pois há bênção nele; assim farei por amor de cristo? 17 pois eis que faz reluzir o seu pé; 25 de ferro do machado caiu na água; e depois edifica a sua voz o deserto até que passem as calamidades. 2 clamarei ao deus do céu. 21 assim fizeram os filhos dos homens! 22 ofereçam sacrifícios de justiça, e confiai no senhor; que não caia eu. 15 então salomão congregou em jerusalém era uzi, filho de acazias, e o senhor acerca de ti todo varão dentre vós será circuncidado, por as', '1980-12-04 03:54:19', 5, 30, 58, 1253),
