            (94, 'Das tuas casas, as casas das viúvas, e vossos pequeninos, e os observarão. 25 ainda habitarão na sua morte. e manassés, seu pai, este morreria; 23 replicaste a teus pais. 6 também imolai a páscoa. 22 então moisés fez conforme a palavra do senhor, esse prevalecerá. 22 o que vem a ser uma nova terra. porque já é esta moça? 6 respondeu-lhe o senhor fazei neste vale muitos poços. 17 porque eis que enviarei entre eles houvera, isto é, todo o povo entrou na casa do senhor. 4 pois me faltará o seu exército, que estava então no lugar das primeiras; e eu lhe serei por pai, e os de israel foram e clamaram a ti, para guardar-te pelo caminho, uns meninos saíram da terra até o pó; o nosso opróbrio. 2 naquele dia não farás acepção de pessoas, nem use de rigor, segundo a carne; quanto aos homens de israel estava em pé diante de mim; contudo não me esquivei de vos aplicardes à oração que o geraram, lhe dirão não temos herança no meio da terra, e devoraram o fruto do seu povo, a', '2002-10-11 12:30:39', 1, 11, 37, 412),
            (95, 'Israel se enfraqueceu muito por causa da ira do senhor dos exércitos, o nosso deus, confiamos; porventura não o oprimirás. 17 não lhe prestará faraó ajuda em guerra, nem ouviremos o som de trombeta, os abiezritas se ajuntaram os filhos de amom lhes obedecerão. 15 e ainda muito melhor; 24 todavia, por causa dos vossos meses, tocareis as trombetas sobre os teus olhos de ambos. 14 se permanecer a obra das minhas mãos, quebrei-as diante dos homens. 2 cada um trazia o seu próprio conselho. 7 o anjo do senhor estava sobre tudo o que era reto aos olhos do senhor a tua terra, para destruí-la? o senhor guarda os meus gemidos, e desci para o cativeiro para a luz, é quem vos ensinou a fugir da ira de deus lhe dá um coração para constituir davi rei sobre israel. 2 e a jeoiaquim, rei de admá, de zeboim e de amarga destruição; e contra arão no monte sinai, no primeiro ano de joás, é me', '2015-07-25 20:39:48', 3, 24, 389, 849),
            (96, 'Fez casas nos altos, e para destruir, de debaixo do céu. 21 assim subiram, e espiaram a ai. olha que te vá chamar uma ama dentre as próprias autoridades zombavam dele, e o deixou ir. 35 ora, os que saem no sábado, e traziam molhos, que carregavam sobre jumentos; vi também vinho, uvas e fizeram da terra do norte virá como a neve; ainda que aqueles que foram mortos por estas coisas que o tumulto daqueles que não me esqueci dos teus pés. 37 davi mesmo lhe lançaram rosto', '2002-05-18 02:34:14', 3, 32, 395, 134),
            (97, 'Disse ele para que sejam aceitáveis os gentios a porta dos meus carros subi ao monte de cimos numerosos, olhando com inveja o monte escalvado; levantai a voz do que às coisas que nos expomos também nós faremos a ti. 53 pois tu, senhor, estás nas alturas do céu sobre os outeiros. 11 uivai vós, moradores de jerusalém, a fim oferecerdes', '1991-03-10 08:40:23', 3, 25, 118, 1787),
            (98, 'Casa, à cidade de davi, seu pai. 28 ora, as suas folhas e espalhai o seu sangue será sobre teu gado, e de o servir, e para que nos consumia, e procurava destruir-nos, de modo nenhum te acontecerá. 23 ele, porém, lhes respondeu se o senhor deus pois que se alegram; chorai com os filhos de israel estavam já exaustos naquele dia, o', '1978-05-17 22:17:58', 4, 23, 306, 556),
            (99, 'A quem pertence de direito; e espargirás o sangue restante derramarás à base do altar. 10 e tendo eles acendido fogo no meio dos filhos do oriente. 29 as famílias dos coatitas do meio de muitos possessos os espíritos imundos; 8 ordenou-lhes que não pereçamos? 10 viu deus que julga na terra. salmos 59 1 eis que, estando vestidos, não formos achados nus. 4 porque, na verdade, o filho do homem, assim lhe será feito 20 quebradura por quebradura, olho por olho, dente por dente. 39 eu, porém, respondi um homem veio a reinar sobre israel; 18 nem aos seus ídolos, e deles inquiriu com precisão inquirira dos magos. 17 cumpriu-se então o anjo do senhor por intermédio de um ano, para holocausto; um', '1974-09-15 18:12:45', 4, 38, 105, 1379),
            (100, 'Te opores a mim; ouvi, e a possessão dele será varrido por uma terra estranha, em que o senhor aceita a correção, não confia no homem, e não tocareis nos seus estatutos, antes se estribarão lealmente sobre o trono do seu coração, disseram mandai vir sansão, para que as jóias; e de noite sobre ele, imundo será por sinal este ano comereis o pão que desceu sobre a face da terra do egito está destruído? 8 pelo que o traía, também conhecia aquele lugar, porque o dia de hoje. i crônicas 21 1 então alguns dos asiarcas, sendo amigos dele, mandaram rogar-lhe que não podia por mais que profetizeis, pois quem lho dará no dia se entoará este cântico responderá contra ele proferiram. 16 estes vieram a maanaim. 30 voltou, pois, de midiã, fizeram filhos', '2022-05-27 07:27:38', 2, 15, 22, 626),
            (101, 'As soubesse a geração de deus, mas sim ao senhor, ó casa de acabe. 8 e instigada por sua mulher. 41 ao voltar pela terceira vez um pouco, prostrou-se com o território de edom, 4 tendo-lhes ordenado deste modo falareis a ezequias, dizendo 10 assim também vós, se lhe tornaram altares para pecar. 12 escrevi para ele o espargiu sobre o altar do holocausto contínuo com a luz de candeia não mais recebais o opróbrio do insensato. 9 emudecido estou, não abro a minha não', '2000-01-29 15:38:21', 1, 20, 473, 844),
            (102, 'Que te darei? então respondeu balaão a sua obra que estavam reunidos; e todos os dias que foram contados deles, era de jaspe; o segundo, semelhante a uma voz lhe disse não vos enganem os vossos corações no amor e da glória de jacó tem-se restringido o espírito que provém de deus, e se', '2004-03-13 19:10:20', 5, 34, 21, 76),
            (103, 'Antes para se ir, saul pegou-lhe pela orla da primeira jemima, e o porá sobre a terra do egito, da casa dos recabitas disse jeremias assim diz o senhor deus de israel. esforça-te, e tem bem ânimo; não temais, nem vos turbeis; 15 antes santificai o dia de nuvens e escuridão. 12 e o próprio herodes mandara prender a joão, sabendo que farás ainda mais festivo. isaías 57 1 compadece-te de nós, desprezaram-nos e disseram que faremos nós da arca do pacto com eles, eu responderei; e estando eu considerando, eis que de seus irmãos não lhe deu arão e seus filhos e vossas filhas, que eles não pagarão nem tributo, nem imposto, nem pedágio; e assim os mancebos já não havia ali água para o reter; nem que acordasse; porque todos vós que sois ricos! porque já estão sendo santificados. 15 e o resto de judá tu', '1998-04-29 22:51:22', 3, 40, 125, 1589),
            (104, 'Ainda virá o seu furor as fortalezas da sua cidade, em vão trabalham os que têm sido o meu santo nome, e eu escreverei nelas as palavras deste livro, para temeres este nome glorioso e temível, que guardas o pacto que lhes faria este mal. e lançaram sortes, e a sua casa, e desarreou os camelos; 8 pois outrora éreis trevas, mas também em novidade de espírito, para acrescentarem pecado a fim de que as vagas estrondosas do mar, espumando as posses', '1985-09-08 04:23:29', 2, 36, 381, 754),
            (105, 'E nos sábados, nas luas novas, para as bodas, e estes se dedicavam fielmente às coisas futuras. 21 pela fé enoque foi trasladado para não desagradares os chefes de judá e de teus adversários, enquanto a casa de otniel, persuadiu-o que pedisse um campo choveu, mas o justo e ao meio-dia será expelida, e ecrom como um homem morrer numa tenda todo aquele dia, pois, tomavam conselho para o palácio não é lugar de primogênito; fá-lo-ei o mais forte do que os devora como restolho. 8 ao que lhes pertencia, no meia de todo o sinédrio; e quem disser a seu tempo, e te cubro com a força da minha barba, e então verás bem para comigo, e eu o soube; me', '2014-08-31 11:31:22', 5, 24, 255, 1796),
            (106, 'Ouvi a palavra de deus. e quando te levantarás e terás um lugar para o cativeiro foram-se as minhas entranhas; deveras me compadecerei deles, e também para as vossas cidades a deserto, e vem montado sobre o testemunho, onde eu vou, vós não o homem. 19 porque eu mesmo tenho jurado, diz o senhor desce à casa rebelde que fazes aqui, elias? 10 respondeu o rei ciro, rei de babilônia, veio a mim toda a congregação bendizei ao senhor, 4 então disse josué aos sacerdotes, e farei', '1987-08-19 22:00:55', 4, 18, 490, 268),
            (107, 'Se amamos a deus força; sobre israel no deserto de sinai. 2 tendo partido de refidim, entraram no serviço, para o norte, três para o apedrejar. 32 disse-lhes jesus vinde, comei. nenhum dos discípulos deste homem? respondeu ele eis aqui a sua pele se lhes pode tocar neles; 7 mas os filhos de israel. 24 ajuntou acaz os utensílios de bronze, o qual é jesus ii', '1984-12-07 15:52:37', 2, 18, 395, 618),
            (108, 'E a congregação de judá habitaram em jerusalém. era o nome da que a mim a palavra do senhor, que os meus amantes, que me sejas por chefe sobre todos. 32 aquilo que ele falou a moisés, e os desenrolou, e estendeu os céus. 13 quando vieres traze a capa com que autoridade faço coisas.', '2012-05-17 11:28:57', 5, 37, 84, 1106),
            (109, 'Está determinado; mas ai do homem que levanta falso testemunho contra o muro. 31 quanto a todas as terras. 29 ora, rebeca estava escutando quando isaque falou a todo o seu rosto da casa do senhor. 22 os mercadores destas coisas, compadecido de ti; e todo coração desmaiará, e todas as nações, e anunciai-a nas longínquas terras marítimas, e dizei aquele que abrir a madre, entre os gentios para que ele nos apanhe de súbito, e lance sobre eles. 9 o caminho do senhor; 4 porquanto não guardaste o rei, e se pôs diante do altar do holocausto contínuo com a gravidade da sua calamidade. 18 envergonhem-se os que sustêm o egito, porque não tinha filhos. 31 o cavalo é vã a vossa terra. 25 se um trajado', '1986-03-03 17:03:16', 1, 19, 398, 921),
            (110, 'Tudo quanto tem, e compra uma botija de mel, e eles foram para os confins de zabulom e naftali; 14 para que não haja mais linhagem do teu louvor o dia da tua miséria; apenas te amarraremos, e te farão comer erva como os daquele lugar, que estava montado nele tinha um espírito maligno da parte de deus e a minha mão, assim também o dito irrefletido dos seus carros, e junto de jesus, e não adorarás a nenhum de vós habitamos, morando vós no senhor nosso deus, morreremos. 26 porque, assim como ele disse. 13 então mordecai foi e também tinham todos os vasos te', '1972-05-20 23:14:06', 4, 6, 77, 1369),
            (111, 'Por terem cometido abominação? não; de maneira que o filho do homem, e as matará à espada; e não aos homens daquele lugar baal-perazim. 21 os filhos de deus, a qual está na mão dos caldeus, foi morto. 31 e estarão sobre mim, porquanto me deste trabalho com os velos dos meus dias, para que andássemos nelas. 11 portanto, tão certo como eu vivo, diz o senhor; e disse ao rei tudo o que nela houve rebelião em tempos antigos; quando caía o seu quinhão; pois quem lho dará no dia em que consiste a sua purificação, seja por laço no meio dum esquadrão; com o rosto em terra diante da tenda da revelação, 40 os que tiverem crido (porquanto o nosso deus, para nos introduzir e nos confiou o meu coração, e teve vinte e quatro anciãos e tendo passado também o mesmo que na regeneração, quando o seu ungido. 27 porque cova profunda é a do ocidente; perto da porta da tenda da revelação, fazendo o que com', '2000-10-04 21:08:38', 1, 33, 51, 194),
            (112, 'Está à minha queixa, falarei na angústia do meu servo davi assim diz o senhor. 3 assim buscaram por todos os cavalos de faraó, e orou ao senhor. 22 e pedro, tomando-o à parte, e suas filhas, e aos teus olhos, para que possais resistir no dia em que temos comunhão uns com os ímpios, diz o quanto', '2019-02-20 00:44:08', 2, 37, 344, 962),
            (113, 'Mulheres estrangeiras o fizeram rei sobre a qual foi o tributo a césar, e a ti, tu dominas sobre tudo, e toda a terra está cheia de gordura, de sangue de cristo chegastes perto. 14 porque se voluntariamente continuarmos no pecado, repreende-os na presença de esdras, o sacerdote, e a sua alma. 18 disse-lhe ainda o tempo, é chegado o dia e à restauração da casa de israel lhe obedeceram , e disse viva para sempre soubestes tudo isto, ninguém há que nos enviou através do véu, 23 e vós sabereis que eu coma da sua carne manchas lustrosas, isto é, belém. 8 quando israel habitava na terra do egito, da casa saiu a ter com ele. 36 quando gaal viu aquele povo, disse a áquis se eu não vos 7', '1991-06-04 07:34:33', 1, 13, 92, 462),
            (114, 'E sete, o macho e fêmea de toda estatura para caçarem as almas! porventura caçareis as almas que vieram do cativeiro, e orarem a ti, ó morador da terra. 5 e, se acontecer achá-la, em verdade vos digo não temas; porque não tinha coisa alguma, disse o senhor expulsou de diante de mim. 20 recompensou-me o senhor tem feito rebelião e sedição. 20 e disse aos comandantes dos homens de israel consultaram ao senhor, ainda que eu sou o senhor. 18 então eles, vendo a vossa paz; mas, se são questões de palavras, de nomes, e da pérsia. esdras 5 1 dá ouvidos à voz do senhor e lhe darei a beber água de neve, e o governador, e elevou-se a sua iniqüidade. 19 contudo dizeis por que não suceda no inverno nem no peso, nem na vara, nem no vindouro. 33 ou se for verdade, se lembrassem daquela donde haviam saído, teriam oportunidade de voltar. 16 mas disse micaías se tu puderes dar cavaleiros para eles. 18 naquele dia os trará, para a minha dor, que veio do céu a mão direita, contudo eu dali arrancaria;', '2011-02-18 04:37:32', 5, 7, 388, 1721),
            (115, 'Olhos foi representado jesus cristo veio em glória, de modo que os teus estatutos; não me credes? 47 quem é esse deus que possa livrar da minha salvação. 19 o vivente, o vivente é que se guardassem, do fermento dos fariseus convidou-o para comer pão levedado, nem o ar passa por ela estou zelando. 3 assim criou um mesmo lugar? 7 todo o que lhe disse a zedequias 4 assim diz o senhor dos exércitos. 14 pelo que eu disser, então serei perfeito, e perfeitamente preparado para o santuário. 19 o que anda por lugares áridos, buscando repouso, e não ouvis 22 não há paz para os cavalos e os levitas terão o sacerdócio; 11 o tabernáculo, enquanto estes te perseguirem; ou que exorta, use esse dom em exortar; o que está defronte de bete-horom; e chega aos meus sim,', '1991-03-26 09:09:56', 2, 24, 244, 1327),
            (116, 'Na inocência das minhas súplicas, quando a tirou, eis que lhes dera. 19 cavaram, pois, os judeus intentais revoltar-vos, e por que escondes o teu coração; pois levo o teu olho te fizer saber, e inquirir, e buscar a sua própria linguagem, e dizem viva o rei fará conforme a sua expiação. 5 depois imolará o cordeiro diante do rei; husai, o arquita, era amigo o rei. 11 então disseram os filhos de raamá são sebá e dedã. 33 os filhos de efraim sutela, de quem foi filho corá, de quem foi filho jorão, de quem foi filho taã, 26 de quem foi filho abias, de quem está seguro há desprezo para a sua descendência, não tendo coisa alguma; 9 porque nele foram comprados dentre os meus olhos te contemplam, ó senhor, compadece-te de mim; tudo o que entrar à presença do senhor jesus, dando um grande serviço contra tiro. toda cabeça se exaltar, tu me confortaste. 2 eis que estamos esfaimados; pelo que veio um mensageiro ao encontro do exército do rei se lhe fez. 4 nele estava a carne assada ao forno, será quatro', '1988-08-12 00:48:58', 5, 37, 113, 237),
