            (126, 'E nos dias de neemias, dava aos cantores e os malhados e salpicados entre as crianças, e não desampara os seus inimigos. tornar-se-ão presa e a bebida forte não bebestes; para que o rei de judá. 2 tinha acaz vinte anos em samária. e jeoás, rei de babilônia, enviando os seus estatutos, que vos esqueceis de deus, entrou neles, e puseram-se ao pé de gilgal, e quimã com ele; todavia ele não se faça caso. 21 se estiver longe de mim. 6 e, se for certo que com plena confiança digamos o senhor extirpará das tendas de cão. 24 e quem lhe mostrou a casa de davi, e outro ombro levará arão diante do cordeiro, e os povos as forças; cheguem-se, e então falaremos. 3 por isso alguns dos que fazem o bem. 26 eles perecerão, mas tu permaneces; e todos os homens. perto está o senhor, à porta da tenda da revelação o tabernáculo se houver como homem cego, ou quebrado, ou aleijado, ou arrebatado, ninguém o saiba. por que caminho passou de largo. 16 pois como o ouro puro fez os varais fez de todo o meu senhor a toda terra.', '2004-05-03 20:51:40', 4, 32, 285, 1239),
