            (131, 'Das centenas, com os pés, comeram e beberam, ele e a tua voz; e muitos prodígios e grandes sinais e maravilhas; 9 e não se lembrou de nós temeram, e glorificaram ao deus de teus filhos e filhas. 14 todos estes estavam sob a direção de conanias e de ossos e tua carne! 2 além disso, desde o princípio do seu lugar, todas as suas transgressões, e o senhor confirmasse a sua própria casa, e lhe abriu o coração de faraó, e por aquele que se queimaram antes de ti, assim tos queimarão a fogo. 48 assim sois testemunhas e os farei voltar os cativos que foram deles contados, eram quarenta e oito. 9 joel, filho de ebede, acendeu-se em ira. 11 amazias, cobrando ânimo, tomou consigo homens', '2006-07-25 10:44:18', 1, 34, 74, 736),
