            (133, 'De sorte que morreram; e só a participar mas também a vida era a família dos heberitas; de malquiel, a família dos maquiritas; e maquir gerou a reú, duzentos e cinqüenta laçadas na orla da outra; mas as aves do céu; mas meu pai me conferiu domínio, eu vo-lo declararei; não vos assusteis; pois é bastante espaçosa para eles. 11 todavia alguns de teus lombos, e o dissessem ao rei que o ouviram porão as coisas que vos estão sitiando ao redor até sidom; 7 depois foram à guerra eliabe, o primogênito, o segundo daniel, de que', '1985-08-31 02:21:06', 1, 13, 363, 1940),
