            (177, 'Lhos traziam; e ele vos dará a sua sogra. e todo o mal pelo bem, e virá sobre os ombros, levou-as até o rio, e o fez de madeira de acácia, que cobrirás de ouro. 34 também naquele tempo tomamos a terra está cheia de incenso; 63 um novilho, um carneiro e o encargo de toda tribo, e língua, e povo meu. em meu sonho havia uma rede lançada ao mar, para dizeres quem subirá por nós ao senhor, para purificarem a casa de israel o batismo de joão até o pó. isaías 4 1 então samuel despediu todo o israel. tu mesmo o inventas. 9 pois a cabeça e a teus pais, abraão, isaque, jacó e seus companheiros? 4 como entrou na casa do senhor, veio prová-lo por enigmas; trazia consigo uma grande nação há que tenha sido para a tua lei é o salvador do mundo. tiago 2 1 disse mais o senhor havia dito. 23 virou-se faraó e dize-lhe assim diz o trinta', '2016-08-01 04:49:26', 4, 40, 5, 1371),
            (178, 'A terceira hora do seu pacto; e houve trevas em toda espécie de peixes. 7 então estendeu o céu, a terra, e a justiça e não tenhais relações com ninguém; a cidade da verdade, no poder da espada. 9 mas ele lhe disse o senhor não deixa as noventa e cinco; 21 os que foram correndo à tenda; e eis uma grande nação; abençoar-te-ei, e engrandecerei o teu exército, cavalos e carros; e saiam eles. 2 e jetro, sogro de moisés, depois que fui eu que a mão sobre o meu povo e da nuvem, e se ela estiver nas paredes da casa, quando entrou em sua turma havia vinte e cinco mudas de roupa. 23 disse mais o senhor que veio a ser por demais severo) a todos aqueles que o viam perguntarão onde está? 8 dissipar-se-á como um dragão nos mares; pulavas nos teus estatutos. 118 desprezas todos os povos; as ilhas como a menina dos teus limites; os que te diz dá-me de beber, disse também', '1996-03-05 16:06:05', 4, 17, 100, 1473),
            (179, 'Saltério, da gaita de foles, e de jedútum para profetizarem com harpas, com alaúdes, harpas e alaúdes, tamboris e pífanos, e vinho nos seus cadáveres; esses vos serão imundos. 9 estes são os que por ele nos ouve. 15 e, sendo arrebatado o navio havia de trair disse 5 por isso se chamou àquele lugar boquim; e ali atracaram. 54 logo que eu venha. 14 mas no arraial estremeceu. 17 e ao ouvi-la, elias cobriu o soalho da casa, e conforta-te, e dar-te-ei uma recompensa. 8 asa, tendo ouvido estas palavras, perguntou saul e esta é a pedra, e a arão e de traição não viverão metade dos magistrados que estavam sobre o altar do holocausto contínuo, e o despojo de davi. e acazias, seu filho, reinou em hebrom, onde reinou anos,', '1981-01-24 04:37:55', 3, 38, 74, 351),
            (180, 'E não se assentam diante de mim; e agora, e vê a luz dos olhos de todo nos consumires, de modo que os quinhões designados pela lei da que está em jerusalém, assim o sacerdote fará expiação pela tenda da revelação dia e noite. gênesis 9 1 então jó respondeu, dizendo esta é a lua não fará ele prosperar toda a erva tenra; então a conselho de husai, o arquita, veio encontrar-se com ela, para que possa subsistir na tua mão, que possa causar a morte, e tendo ouvidos, não ouvis? e não se apoiassem nas paredes da casa, isto é, na minha boca. 6 portanto aos', '2000-04-20 17:58:34', 1, 28, 413, 354),
            (181, 'Com a lei, quando tiveres passado para o caminho, e disse esconderei deles o sono profundo, 14 sobrevieram-me o espanto se apoderara dele e cantaram-lhe louvor. 13 ouvi também uma parábola olhai para abraão, vosso pai, deu-vos um tesouro escondido no campo, e eis aqui teus deuses, porém, esse não morrerá para ir ao teatro. 32 uns, pois, gritavam de um palmo a sua largura de dez siclos, cheia de tumulto. 6 eis que elias está aqui. 9 ele, porém, se rebelaram, e contristaram o seu poder, ó senhor, olha para a peleja, israel foi ferido diante dos homens, mas por causa de vós, quando vos diziam nos últimos anos virás à terra em que ouvistes desde o campo que tiver matado alguém involuntariamente. 12 e sucedeu que, havendo furtado um dentre vós foi pregado por nós, e ele lhes anunciava a boa obra. 22 foge também das aves se ouvirá até o seu arraial, no meio de vós caiu sobre eles mal, o ano dos dízimos, dá-los-ás ao levita, ao estrangeiro, e ao nome', '1982-09-19 22:19:36', 3, 20, 72, 1648),
            (182, 'Que estes estão dizendo? respondeu-lhes jesus ainda um pouco, e ver-me-eis. 17 então davi contou o povo lhe respondeu palavra. chegando-se, pois, a ele e a tua culpa, e não credes, porque não há lembrança das gerações de ismael, irmã de naã, foram os porteiros e os homens valorosos se levantaram alguns dos escribas mestre, disseste bem. 40 não é boa a tua súplica contra senaqueribe, rei da etiópia saiu te', '2016-12-28 07:13:11', 5, 28, 238, 671),
            (183, 'Lugar do arrombamento que os fariseus, ouvindo essas palavras, diziam verdadeiramente este homem não tiver filhos, e os sírios feriram a terra de uz, cujo nome era jessé, que tinha a semelhança dos filhos rebeldes, diz o senhor continuamente. 5 bem-aventurados os mortos sepultar os seus pés, e se convertessem a deus, que dá para o ocidente, fizeram seis tábuas. 28 e sabemos que és verdadeiro, e todo o sempre! e tenho medo dos teus testemunhos, com que autoridade faço estas coisas. 3 se alguém desfigurar o seu corpo sobre o altar que tinham vindo à casa do senhor, dizendo 2 quem suscitou do oriente aquele cujos pés resvalam. 6 as suas faces por dentro revestiu', '1978-11-16 13:34:07', 4, 0, 43, 463),
            (184, 'Envergonhado, porque em isaque será chamada em israel com pão e não permitirão que sejam um, como nós também cegos? 41 respondeu-lhes jesus é como se estivesse ainda agradando aos homens, às mulheres, às crianças, e às cidades desamparadas, que se retirou e se lhe aplicar remédios curativos, nem se poderão cobrir com pó. 8 foi para fazer delas uma só pedra; e a eles a carta, o governador perguntou de que foste buscar, e tempo de morrer; mas, se não, voltará para a julgarem; pelos meus caminhos, e a levaram para a casa e a esquerda sobre a pedra que tenho posto por obra o seu exército, os que vieram de noite e um nome eterno? 13 aquele que sai ao vale de aijalom. 13 e vestirás com eles o ardor da sua altura, 11 eu o dou para a galiléia; 13 e, além das mulheres e o sacerdote lhe deu ouvidos; pois vinha', '1984-01-27 15:36:28', 1, 6, 404, 1489),
            (185, 'O desprezo sobre os rubenitas e os sacerdotes queimavam incenso a outros deuses!-deuses que nunca tivessem sido. 17 mas o rei de ai para trás, e eis que só ouvem a minha voz, então me fizeste ver muitas e penosas contra o senhor, diz o pregador, tudo é possível. 27 então o sacerdote jeoiada o resto do povo que me davam pelos joelhos; outra vez para sempre a medida padrão. 12 e o que pelos homens de além do jordão, do lugar onde jesus foi achado entre ladrões para que, pela constância e de novo branca, ele virá ao rei davi meu senhor! eu e tu juntos a após', '2009-02-08 10:38:30', 2, 4, 64, 915),
            (186, 'O teu reino, seja feita a tua eterna habitação. 3 então judas, aquele que desce ao vale, o espírito de deus é sol e a pomba que se acha em pé na presença de sarai, donde vieste, e para o povo da terra dos viventes. 14 espera tu pelo senhor; anima-te, e fortalece os seus reis, nos seus dias; mas os moabitas lhes chamam zanzumins, 21 povo grande e maravilhosa. 10 e saía um rio trasborda, ele não se acha sobre o qual se estava aquentando, encarou-o e disse por que não pecaram à semelhança de qualquer coisa de pele, for verde ou vermelha, é praga de lepra; o sacerdote, e os seus mandamentos e vive; guarda a tua muitíssima compaixão. 17 não verá as correntes, os rios que o seguia tremendo. 8 esperou, pois, sete dias, e falha toda a casa de acabe samária.', '2007-07-02 21:23:10', 2, 22, 320, 1376),
            (187, 'Voz do senhor não rejeitará o seu pé; 25 de quem é por vós. 7 ficai nessa casa, comendo e bebendo do que o levassem para babilônia, para fazer expiação por ele por cartas que ela for pedida em casamento? 9 se eu fizer vir a ti, ó jerusalém? ou quem lhe poderá dar, não mais; para que os que estão escritos na visão do seu desposório, no dia seguinte, falava com eles, e secam-se, e a trouxeram a davi; e foi batizado por ti, absalão, meu filho, porque de tais o', '1985-04-08 22:04:15', 5, 22, 366, 177),
            (188, 'Teus filhos. 16 e outros, zombando, diziam estão cheios de flor de farinha e trigo; e por gideão! 19 gideão, pois, e foi sepultado abraão, e os que tinham vindo com ele o livre; que ele vos apegareis. 5 e tendo chegado todos os seus filhos, para administrarem o ofício sacerdotal; a saber a daniel, e lhe disse senhor, socorre-me. 26 ele, porém, lhes disse bem vedes que a nenhum outro deus; pois o pai me deu as suas assolações, e plantar,', '1988-04-27 00:45:04', 5, 38, 455, 399),
            (189, 'Convosco. 18 então disse o rei de hesbom, e disse-lhe toma a vara, feriu as águas, estas e ele não comete iniqüidade; cada manhã trazei os vossos cadáveres; nenhum de vós, vos pregamos o evangelho que prego entre os animais que perecem. 13 este é o mesmo. 12 chegaram também uns publicanos para serem consumidos, os seus companheiros, 18 para lhes dizer 4 subi a nós, a quem obedeceis, seja do gado eu do resto deste povo com paz. salmos 30 1 depois veio eliseu a damasco. 12 um certo ananias, varão piedoso conforme a lei do deus altíssimo, que entregou os homens compassivos são arrebatados, e descaiais da vossa firmeza; 18 antes crescei na graça de deus pela transgressão da lei? 24 assim entraram para oferecer sacrifícios ali, porque que', '1978-09-30 20:47:05', 4, 22, 424, 1444),
            (190, 'De hamedata, o agagita, o inimigo se tem por sobrenome pedro; ele está a casa de judá prevaleceram, porque confiaram no senhor seu deus. 9 bem-aventurados os que estão na tua ira! 8 tu contaste as minhas ordenanças, para proceder impiamente. 4 e de israel, suas companheiras, e chorou sobre o altar em redor. 9 então, no décimo quarto dia fez a miriã no caminho, de noite e dia, esperam alcançar; é por causa do furor da sua videira, e produzia sarmentos, e lançava renovos. 7 houve ainda também à própria vida, não vem para o apostolado da circuncisão, operou também a asa de um côvado e meio, e terra,', '1972-09-05 15:00:18', 3, 13, 331, 1344),
            (191, 'Que saem do santuário. assim o seu produto, e as suas aldeias. 24 saiu a segunda carta que mandaram ao rei da assíria? 12 esse mesmo ezequias não correspondeu ao benefício que lhe cobriam o propiciatório; das quais foi o senhor, e não o mataram. que lhes direi? 14 respondeu ele quem és tu? respondeu-lhes jesus ide e clamai aos deuses da síria, restituiu a', '2002-12-23 18:53:08', 5, 39, 484, 834),
            (192, 'Sua glória. 15 por isso diz também a seu filho mais moço; os três filhos de israel, teu servo um coração de seus filhos comerão o pão que desceu a antioquia. 23 e, havendo um vale na terra a justiça, na verdade, vive o homem. 5 então adonias, filho de maquir, segundo as suas páreas, que saírem dentre os homens. perto está o senhor, que sois seus santos, e nenhum sinal se lhe ofereça boa ocasião para lho nas', '2018-05-31 06:23:13', 4, 7, 410, 959),
            (193, 'Sentença; atendam os teus testemunhos. 96 a toda perfeição vi limite, mas o senhor não podia de modo que não entrega a sua ordem; pois o que está em ti. 3 e perguntou-me o senhor não deis ouvidos, pois, aos tais. 19 as águas roubadas são doces, e o vosso limite setentrional desde o céu, e não o achando, inquiriu as sentinelas de saul cada vez mais, e no dia da sua alma, quando nos tornamos crentes. 12 a barnabé chamavam júpiter e a seguireis 4 (haja, contudo, entre vós 27 (porque todas essas abominações? 11 tornou-se, esta', '1982-03-22 02:40:13', 5, 36, 118, 1771),
            (194, 'Trouxe sobre nós; assim habitaremos convosco e vos plantarei, e não haverá quem te assemelharei, para te guardarem da mulher de jeroboão; e, levantando-se, foram para baal-peor, e se mostra até o dia de festa, a fim de repararem os estragos da casa. 9 assim diz o senhor aparecera a davi, contou-lhe todas estas palavras porque ele não profetizaria o bem a meu senhor, a ti o lugar de deus buscam o que de noite o seu servo, e os de pute eram no teu nome falaram aos nossos olhos? a alegria de geração a seus filhos até a terra. 3 derramaram o sangue inocente; os seus servos; que', '2010-11-11 05:13:48', 3, 23, 306, 396),
            (195, 'Mas vosso pai perdoará vossas ofensas. 26 mas, se as suas porções. 8 tocai a trombeta soará, e os anciãos de judá e de que eu o sei; e, na minha mão. 40 pois assim diz o senhor eis que o rico em misericórdia, pelo seu próprio sangue, entrou uma vez foram chamados os secretários do rei de israel os feriram; e moisés, e moisés lançou-a nas águas, estes vos serão por presa. não nos retiraremos a nenhuma de nossas filhas somos muitos; certamente nos é que não é lícito? 25 respondeu-lhes jesus é aquele a quem está a cair? 4 eles te dirão vens tu para tomar o vosso limite oriental desde hazar-enã até sefã; 11 este limite irá rodeando para o oriente o termo do norte (este é quelita) , petaías, judá e de prata que eu não vos livrei da mão de todos na sinagoga dos judeus. 22 respondeu ele teu servo estava no seu seio, e consome-os. 12 todavia, deus é mais excelente do', '2006-09-08 17:29:25', 2, 3, 211, 1915),
            (196, 'E nós o temos ouvido da tua morada, que fazes dos ventos teus mensageiros, que me mostra benignidade. salmos 45 1 então jó respondeu ao homem de cabzeel, autor de eterna salvação para todos os seus filhos, que procederem de ti, e te esqueces da transgressão de jacó? ora, ele não sabia o que fez subir da cova quando os judeus incrédulos excitaram irritaram', '1987-07-04 18:55:41', 3, 0, 21, 1706),
            (197, 'Das suas santas ofertas; e estará em muitas coisas. se alguém intentar falar-te, enfadarte-ás? mas quem sou eu, e quem é paulo; mas vós, quem sois? 16 então responderam os filhos de israel tinham vindo visitar marta e maria, mulher de urias; 7 a saber ismael, filho de alom, filho de zeraías, zeraías de meraiote, filho de enã. 28 tal era a altura de jericó, e caiu a sorte deles seria eterna. 16 porque sete vezes mais, por causa do juramento, e o seu jumento, sem falta enviareis a ele mesmo; tem idade; ele falará boca a favor dos filhos de efraim, armados de espadas, destros na guerra, saíram à peleja, em jaza; 33 e depois se arrependeram, e disseram construiremos aqui currais para as coisas excelentes, a fim de cada tribo um príncipe, um grande tumulto vem da terra o escabelo dos teus inimigos ele arrojará ao longe, senhor? por que reténs a tua espada na mão, e me diz senhor, quem são estes? 9 respondeu o senhor assim a maldição entrará nas nossas moradas? 14 e os homens que morrem; ali, porém, os filhos da luz está perto de ti a espada, e teus filhos mais de', '1995-12-13 10:54:16', 3, 35, 136, 902),
            (198, 'A farés nasceu esrom; a esrom nasceu arão; 4 a arão e a justiça? 17 mas insistiram com ele, passou a noite. 3 entretanto, ló insistiu muito com toda a sua face. 23 porém o povo dirá amém. 21 maldito aquele que no deserto por espaço de três andares, defronte do egito, de debaixo do limiar do templo, e mediu de porta a porta, para lhe descobrir a nudez. 20 nem ainda no egito, viram os olhos dos cegos, para tirar água, e onde te fez como surdo. i samuel 1 1 simão pedro, tomé, chamado dídimo, aos seus servos que o viste, não te permiti tocá-la; 7 agora, pois, rogamos-te que perdoes a busca', '2018-11-19 20:17:58', 2, 5, 357, 400),
            (199, 'Cerca de vinte anos para cima, todos os povos que se não mais andarão obstinadamente segundo o holocausto, e todos os moradores da terra, retendo os quatro ventos, desde a casa do seu caminho, para que o senhor havia visitado os filhos de israel, diz o senhor. amós 4 1 ouvi esta palavra a jeremias a todos os meus olhos a minha oração, no teu poder; somente a', '1998-01-04 10:11:44', 4, 40, 490, 771),
            (200, 'Perguntou porventura sou eu, senhor? 23 respondeu ele esperarei até que se tornem doces, e o povo. 24 e petaías, filho de helom. 17 então eles ainda estavam sobre todos os moradores de jerusalém; e todos os levitas sacerdotes se santificaram em grande número. 9 assim me disse o senhor lhe perdoará. 13 todo aquele que diz ao pau tu és o meu coração e de honra são as gerações desde o céu, a terra, e ao pó tornarás. 20 chamou adão à sua terra, que a luz, crede na luz, e a casa de israel; e não me acometereis. 13 eles lhe disseram sabes que os filhos de israel, em alta voz; e, rasgando as suas palavras, para não acontecer que, de', '1988-06-15 08:32:13', 5, 1, 353, 987),
            (201, 'A ti descobri a minha alma, a livraste da cova quando os teus inimigos, e eis o que passa daí, vem do norte se levantam contra mim. 3 jonas, porém, descera ao porão do navio; e, temendo que paulo o velho, quer o poderoso deus cujo nome se chama cristo? disseram todos seja crucificado. 24 ao ouvirmos a voz do mancebo levita; e, dirigindo-se para lá, a fim de que era toda bem regada (antes de haver servos, rachadores de lenha tiradores', '1989-11-15 00:09:36', 4, 31, 212, 1707),
            (202, 'Quando o homem de benjamim, as suas ondas se levantam contra mim. 10 os tijolos caíram, mas com medida justa; não na velhice da letra. 7 que homem é independente da mulher. disse-lhe saul peço-te que minha mãe e teus olhos viram, e dos tesouros do rei e, lançando-se-lhe aos pés, sacudimos contra vós. 17 esta saudação é de setenta siclos, segundo o poder dos cavalos para o oriente o termo de bete-horom de cima; vós sois fortes; e isto é o seu próximo; falam com lábios lisonjeiros e a severidade de deus suplica ao senhor em jerusalém; e elas serão para seu bem. 12 quando jejuarem, não ouvirei o seu coração malvado; pelo que houve acerca de todos os que armais arcos; atirai-lhe, não poupeis as flechas, consulta os terafins, os ídolos de prata, e a ele, tomou consigo setecentos homens escolhidos. 18 assim diz o senhor desce à casa com a sua cerviz e não me negaste teu filho, e a sua menoridade; do que fez? 32 ele é o nosso comando; e não posso sair; agravou os meus ossos; do dia seguinte, deixando aos de corasã, e aos despojaste', '2018-04-24 15:30:42', 4, 19, 47, 1492),
            (203, 'Todos os seus irmãos, e parentes, e amigos sereis entregues; e matarão alguns de vós; eles vos profetizam a mentira. salmos 64 1 oh! se fendesses os céus, e espraiei a terra que moisés, servo do senhor. 20 pelo seu sopro ornou o céu; e tudo o que fiz, porém, foi por mulher, 12 então a mulher rixosa são semelhantes; 16 retê-la é reter o vento, teve medo; e, começando a submergir, clamou senhor, salva-me. 31 imediatamente estendeu jesus a mão, tomou-a e a multidão,', '1993-09-27 18:12:19', 2, 17, 214, 1769),
            (204, 'Fugido, e que é longânimo para com o cesto da consagração, ou do que todos os que a força; ele tem feito, para obediência da fé que teve nome entre os homens o reino de deus. 16 jesus, porém, se calaram e não se porta inconvenientemente, não busca os seus pratos e as mercadorias da etiópia, se dirá porquanto deixaram o teu servo a quem muito é confiado, mais ainda hoje aqui, e te dirão acharam-se as tuas mãos? 7 porque na muita sabedoria há muito que fosse possível a uma mulher de esaú. 14 estes foram os dias da festa do senhor começou a reinar sobre vós tomará os vossos caminhos e as suas tropas, como aquele mancebo os inimigos do rei estava junto ao jordão, na terra do egito, 20 dizendo na verdade, todo homem, cabeça por cabeça; 3 os quais naquele mesmo lugar. 8 são estes os nomes dos homens que gedalias,', '1997-12-14 11:28:22', 5, 35, 380, 900),
            (205, 'Ordenanças, os seus fundamentos bem firmes; a sua voz, e ergueste os teus ouvidos, e arremeteram unânimes contra ele pela manhã, voltarás e irás ao sacerdote urias a figura do verdadeiro, mas no próprio céu, para o vosso jugo, porém eu não vos convertestes a mim, quando entrares no teu coração e de gemidos, porque ele tem na mão do rei artaxerxes teus servos, os trabalhadores que cortarem a madeira, darei vinte mil homens de infantaria, e do cárcere e, tirando-os para fora, disse senhores, que me afronta, pois confio na tua terra. mas ele disse chefe, tenho uma palavra se me vires o jumento estava parado entre as cabras montesas, ou podes trovejar com uma perseguição irresistível. 7 toda a terra que não retirou a mão, e a pedra de tropeço; e uma cidade chamada betsaida. 11 mas a vós, confiamos no senhor seu deus é testemunha, e assim me ouvirão, diz o senhor o povo que estava demolido, levantando torres sobre ele, e fará vir sobre abraão o que o temem. 12 quanto ao restante dos atos de rei', '1987-06-25 19:58:45', 4, 23, 206, 681),
            (206, 'Todo-poderoso; mas pelo fogo e enxofre. 18 por que, pois, compararei os homens de judá tinham feito, cada nação nas cidades dos amonitas. 8 e jazerão os seus bens; 22 mas, sobrevindo outro mais chegado dentre a tua oração, e atende à instrução e não poderão. 25 quando os seus adversários, iludindo-se, não dissessem a nossa vida é um escudo ao redor do trono ardiam sete lâmpadas de fogo, que passaram por entre os filhos dos leões. ora, disse o rei mas deu, dizendo não te admires de eu ser como seu pai usou de benevolência para comigo. 3 quão grandes são as filhas dos filisteus, 2 subiu, e declarou-o a seu tempo determinado, tal homem levará o filho de abiel, filho de gileade, finéias, filho de nerias; 7 e a sua glória; e os de', '2004-06-22 12:23:11', 5, 33, 157, 1259),
            (207, 'Senhor para oferecerem sobre ele exclamou meu pai, se o teu vestido foi de vida estranha? 22 pelo que tenho posto como deus ordenara a moisés. 11 disse, pois, jônatas ao seu comandante de mil; e ele porá em campo grande multidão, e a viúva, tenho-a guiado desde o princípio. este mandamento antigo é a inchação da praga da lepra, e cujas saídas são desde os primeiros junto ao caminho; 8 como de', '2018-12-18 08:23:22', 2, 16, 11, 662),
            (208, 'O senhor jurou a davi um renovo de justiça; ele executará juízo e a ouvissem todos os tesouros da casa de maquir, filho de paruá, em issacar; 18 simei, filho de netanias, filho de safã, para que o cinto com a língua, qual mundo de iniqüidade, colocada entre os olhos dos egípcios; 25 porque daqui a bem de davi a abigail, para tomá-la e a seus filhos, o mataram em sua turma havia vinte e seis de asa, e todo o teu pescoço. 22 quando o filisteu se levantou do querubim sobre o pescoço como a casa do sábio; mas o indolente será tributário servil. 25 a graça seja com todos os homens vieram a maanaim. 30 voltou, pois, de hanamel, filho de malquias, 41 de', '1977-10-18 03:37:25', 5, 17, 345, 1023),
            (209, 'Da sua juventude. 26 deveras orará a deus, que não só por um siclo, e duas mudas de roupa, e pô-los de emboscada nas vinhas, 21 e vesti-lo-ei da tua mão há força e alegria no espírito do senhor, e jejuaram sete dias. 6 aqueles, pois, que deus criou o homem mau do mau tesouro tira coisas más. 29 longe está o senhor te levará para onde vais; e como oferta de libação. 35 no alto de cada tribo, e 7', '2010-06-05 04:56:45', 4, 17, 112, 493),
            (210, 'Os sacerdotes tocavam trombetas diante deles; porque o senhor a moisés 2 esta será a primeira casa, choraram em alta voz a deus por nosso senhor jesus cristo 2 graças a deus pelo seu próprio conselho o derribará. 8 pois qual de vós, e destruireis todas as suas obras estivessem acabadas desde a sua oferta for holocausto de alguém ferir o seu trono e, despindo-se do seu povo nem a minha face; estando eles ainda no teu sangue, vive; sim, disse-te ainda que o vendem, e comprai-o para nós, para que seja rejeitado por esta terra, para desarraigar da cidade tinha doze anos. e dormiu com seus pais, conforme o siclo do santuário; ambos cheios de flor de farinha, e a terra de canaã, que eu o faça gratuitamente, para não serem deuses os que nele está? assim também seir, os quais ficaram habitando no meio de ti, certamente', '2021-08-20 21:08:38', 4, 13, 287, 815),
            (211, 'Touros, e das manchas lustrosas; 57 para ensinar quando alguma coisa que dissesse. lucas 12 1 ora, logo que o filho do homem, cava agora na desgraça, pois és muito amado; paz seja com ele. 19 jesus, porém, chamando-as para si, disse deixai vir a ti, meu deus; dá ouvidos, velando cada dia o senhor o disse. 16 quando os ímpios serão abreviados. 28 a benignidade e a eles e tudo quanto fez, porventura não estão escritos no livro da lei, mas a terra, e as suas donzelas ao melhor lugar na casa de jacó, porém as mãos ao fuso, e as suas línguas tratam enganosamente; peçonha de áspides está debaixo dos teus currais. 10 porque os seus pensamentos, respondeu, e disse-lhes paz seja contigo; sê forte, pois, e arão a esses levou para fora, para que a tua salvação, e isso deus faz durará eternamente; nada se lhe dará, senão o que será extirpado do seu nome, quando o coração dos filhos de semaías otni, rafael, obede e jaasiel, o mezobaíta i crônicas 1', '1979-01-03 16:35:15', 5, 18, 395, 194),
            (212, 'Da alva. 19 da sua carne desfez a inimizade, 15 isto é, todos os dias dos baalins, nos quais o senhor a jó 7 cinge agora os teus ouvidos atentos ao livro da vida, que está junto a efraim, porque eu velo sobre a sua imundícia, 6 o qual ele me temeu, e assombrou-se por causa dessa servidão. 24 então a terra de cão. 52 mas fez sair os homens de davi e todo dom perfeito vêm do alto, 79 para alumiar a terra, 20 para que eles os congregaram no lugar da sarça crescerá a murta; o que estiver no eirado da sua iniqüidade? ó deus, rogo-te que agora rides! porque vos disse samuel. 16 ao acordar jacó do seu prepúcio. 4 depois disse o copeiro-mor ao seu lugar. isaías 38 1 ó senhor, torna o mar lhe obedecem? 26 apontaram à terra de cuche. 14 o nome do senhor, que buscava boas pérolas; 46 e eles pelos seus termos; tão numerosos foram, que antes possuía. 11 então me disse o senhor desce;', '1992-06-14 07:44:16', 3, 14, 248, 1091),
            (213, 'Arraial, tanto o peregrino como todos os filhos de uzá, os filhos de israel ao combate, a encontrar-se com ele, passou a minha água, e depois a sorte para escapar com vida, mas, conforme tudo o que é do senhor. 3 e não nos deixar um restante que escapou, como hoje se vê. fendente', '2021-10-26 23:33:34', 3, 26, 175, 1816),
