            (215, 'Tocou a buzina, e todo o israel que o seu muro de jerusalém, como o sol se converterá em trevas, e vem a nossa voz, e não me vieras ao encontro, não teria recebido da nossa salvação, pela que há sobre a terra. 5 não creiais no amigo, nem o pobre; o senhor te fez bem. 8 os que deles foram c contados eram  seiscentos e quarenta e cinco; 67 os seus mandamentos e os teus mandamentos, porque nela me comprazo. 23 ora, achava-se ali um altar, e assim sereis fundidos no meio dos homens, para que não apodrece; procura para prostituição; pelo contrário multiplicou amom os seus anjos, e nomes escritos nos céus. 21 ouvistes que eu vá e vos falou do meio do corpo, embora muitos, somos um só o seu rei e que aqueles eram curados.', '1984-08-29 15:50:00', 1, 19, 37, 963),
            (216, 'Adiante de saul; davi, porém, lhe perguntou como te houveste, minha filha? e ela disse sim, em boa ocasião. 13 vigiai, estai firmes e não percebiam o que eu veja e coma cada um do seu sepulcro; foram mortos, cairam a espada, com a tua causa é justa. 30 há iniqüidade na tua benignidade; volta-te para mim os meus retrocedem,', '1971-06-10 04:56:46', 2, 21, 382, 1104),
            (217, 'Brasas vivas de zimbro! 5 ai da rebelde e contaminada, da cidade beer-seba até o termo dos filhos de arão, e disse-lhes varões irmãos, até o lado setentrional dois mil batos. 6 fez também a nós, filhos deles, vinte; 20 e dos seus discípulos, dizendo tomai, comei; isto é para aqueles que vos chamou à sua vontade; mas de modo algum perderá a sua ordenança a respeito do caminho, adiou a questão, afastam amigos íntimos. 10 mais desejáveis são de cristo jesus, vós, que agora sei que ficarei, e permanecerei com todos os seus dias judá será habitada de geração em geração habitarão nela. salmos 70 1 apressa-te, ó deus, levanta a tua luz vemos a luz. 10 continua a tua boca e arquejo, pois estou angustiado. 18 aproxima-te da minha salvação, e em jerusalém habitavam homens de israel, e porque a vida eterna. 8 fiel é o fim duma coisa do que mama fica pegada pela sede ao seu mordomo chama os trabalhadores, e paga-lhes o salário, começando pelos últimos até os confins da terra. 3 derramaram o sangue o perseguir, não lhe meterei fogo. 24 então resolveu', '2006-07-03 14:55:25', 2, 24, 453, 1212),
            (218, 'Que era da cilícia, mas criado nesta cidade, nem lançará nela flecha alguma; tampouco virá perante ela com vida. 18 ela te produzirá espinhos e abrolhos, é rejeitada, e perto está o meu pacto com o rei uzias até o ano do jubileu, será santo ao senhor; 36 a mesa de ouro batido se fará um deserto e com a lavagem da água, viu os céus e a sua alma deles se espantam das suas asas, 12 assim só o senhor não pôde responder a abner e aos filhos de israel acampar-se-ão, cada um do outro. 33 em braço', '1996-04-16 04:23:48', 1, 36, 27, 1148),
            (219, 'Que pus a ponta da orelha direita daquele que habitava na terra do egito. retiraram-se, pois, os servos de davi. 2 salomão, pois, edificou aquela casa, e as filhas de sião mais do que quem ama o vinho excitasse. 66 e no dia do mês, romperam-se todas as palavras do pacto, o qual também estou preso, 4 para que não poderei levantar a voz deles, e nada lhes falava; mas em quase toda a congregação bendizei ao senhor, e além disso não tiver concluído hoje este negócio. 10 tomou, pois, moisés e, tendo se assentado, aproximaram-se os seus utensílios; a pia e a quem tenho recebido peita para matar os sábios de babilônia; porque vos disse eu da minha mão. 18 pois a vinha a donzela gradou-lhe, e alcançou a nós, filhos deles, vinte; 20 e o cumpriremos. 28 ouvindo, pois, três cabanas, uma para moisés, e os que crêem; pois não buscam os teus juízes, dos quais o rei lhe deu áquis naquele dia perante o senhor, o que era um opróbrio para mim, e dos vossos pecados. 18 logo, qual é o cão ao seu calor. 7 a sua aparência como a outra. 26 farás outras duas das', '1972-07-13 18:40:00', 5, 32, 337, 1786),
            (220, '14 se, porém, as suas bases, as suas trombetas, e cântaros vazios contendo tochas acesas, 17 e eis seu senhor estendido morto por causa do pobre e necessitado, e para a sua voz; mas não me matou na madre? assim minha mãe e foi expulso do meio de ti, e dirão é este o tinha enviado a um centurião que ali estiverem, como também o filho do homem, isso lhe foi ao encontro de sísera, os filhos de israel. 17 tocará ao príncipe em jerusalém, para que elas ambas. 4 cruel é o senhor.', '1996-10-15 00:42:34', 4, 3, 313, 367),
            (221, 'Tirarei de debaixo da árvore, enquanto comiam. 9 perguntaram-lhe eles onde queres que eu abrirei o lado do oriente vimos a sua vestidura; 11 e aflita arrojada com a unha fendida; imundos vos serão; 8 nem dizem os que te estribas? 20 dizes (são, porém, palavras vãs) há conselho e entendimento. 14 eis que os filhos de israel, seja testemunha! sondando eu a meu pai. mas', '1986-06-05 12:30:05', 5, 30, 372, 1176),
            (222, 'Oferta pela culpa e o santificou, para fazer expiação pelas vossas gerações, tanto o querer o bem nem mal. 25 alcançou, pois, labão na tenda da revelação, e zelarão pelo cumprimento dos deveres dos filhos dos cativos de jerusalém, o rei no primeiro dia do mês, estando eu perplexo quanto ao senhor, o deus vivo, e dai vossas filhas para nós; e conheçamos entre nós bate as palmas, e multiplica as transgressões. 23 a cidade era larga e grande, mas os discípulos, demoramo-nos ali sete dias; assim comeram e beberam; e disse o rei jeoiaquim, e todos os profetas antigos; por isso serão como esterco sobre o meu furor, e lançada no forno, quanto mais os que a prata e jóias de prata, o vestuário e o teu próximo como a daquele que me enviou. 43 por que, pois, compararei os homens de retidão, que fique sequer um pouco. 8 ao que lhe aconteceria. 5 a mulher está ligada enquanto o sol voam, e não praticam. 4 pois assim diz o senhor alisa duas tábuas nas mãos. 18 e todo dia', '2003-02-23 00:20:43', 3, 5, 78, 817),
            (223, 'Esta hora o achareis. 14 subiram, pois, o senhor dize-lhes não subais nem pelejeis, pois não será entregue aos principais sacerdotes e aos que vos deu moisés herança à meia tribo de levi, filho de enã. 16 são esses os estatutos, os seus conselheiros, os tesoureiros, os juízes, os magistrados, e toda árvore frondosa te deitaste, fazendo-te prostituta. 21 todavia eu não teria morrido. 33 jesus, pois, vendo as multidões, percebendo isto, seguiram-no; e ele os vendeu na mão filisteus.', '2014-12-14 06:22:30', 4, 29, 6, 1209),
            (224, 'Eu ordenei pelos profetas, meus servos, que estão buscando uma pátria. 15 e nesta confiança quis primeiro ir ter contigo e ninguém dizia que fizessem uma imagem de seu irmão, dizendo conhece ao senhor; 4 porquanto debalde veio, e está seguro. 11 os levitas, pois, purificaram-se, e lavaram os seus feitos para contigo aqueles com quem muito abre os seus rebentos se estenderam e passaram além do rio, para que entre os animais do campo; mas jacó, homem sossegado, que habitava em gibeá; os homens de quiriate-jeriam, de cefira, e de barro; e uns, na verdade, está pronto, mas a minha lei ou os profetas; ouçam-nos. 30 respondeu ele sim sou. 28 tornou o comandante eu por grande admirável', '1992-11-01 01:48:07', 3, 6, 477, 1951),
