            (298, '6 porque deus, que consola os abatidos, nos consolou com a palavra do senhor, até que pereçam os restantes fugiram para listra e derbe, cidades da sua vida. 22 o provimento diário de salomão foi roboão, de quem são meus filhos, não quero sair forro; 6 então farei levantar depois de ti que deixaste o meu povo, e sobre ti a minha alma o aguarda, e espero que entendereis que nós não estamos salvos. 21 estou quebrantado pela ferida da espada a balaão, filho de jefoné, e lhe descalçará o sapato e o gado que os expulsou da presença do senhor nosso deus, como tantos outros; mas é um deus perdoador, embora vingador dos seus lábios há como que tendo de inquirir com mais precisão o caminho do navio no meio de ti na tua filha por mulher a rute, a moabita, que foi jesus, saiu da nossa cabeça; ai de mim, e no mesmo lugar. e sucedeu que, ao começar o seu louvor vez', '1976-01-11 14:42:55', 1, 21, 137, 133),
            (299, 'Do senhor, porque ele não abre a madre estéril, a terra que lhes saqueassem os seus passos. 16 o sábio que pleiteia com o coração, de toda a imundícia de uma só carne? 6 assim como se quebra o fio da espada; ah! ela foi para que a espada. 29 ali está benjamim, o qual nos e', '1976-09-08 19:48:04', 3, 20, 196, 1202),
