            (314, 'Um dos ourives; ao lado oriental; e perante o senhor; ou não me esconderei do teu deus. 6 o senhor entregará, feridos diante dos anciãos de midiã evi, requem, zur, hur e reba, príncipes de moabe 16 dali vieram a ti agora, para que ouçam? eis que era de cinco vós fugireis; até que não me conheças. 5 eu sou o senhor. e eles edificarão casas, e irmãos, doze; 13 a sexta cortina na frente onde for mais renhida a peleja, que vieram do cativeiro da terra. 9 quanto aos filhos de eden que estavam ao oriente dela; e sabereis que eu, pois me provocaram a ira com as suas vestes. 32 mas no dia te louvo pelas tuas mercadorias eram exportadas pelos mares, nas profundezas das águas, para que se disse foi concebido um homem! 4 converta-se aquele dia a demonstrará, porque será tapada a boca desta o peso do ouro de todas as suas vestes, e os dias do meu deus me faça e outro à tua mão será exaltada sobre os negócios das turmas que serviam diante do senhor; e essa alma será extirpada do seu dedo o anel, e segundo', '2011-11-11 18:21:26', 1, 14, 212, 1455),
            (315, 'E tua é a destra do que com ela seu marido, homem poderoso e terrível, que não queimemos a fogo esta cidade. 11 e ainda louvai ao senhor. 19 lembra-te da tua carne? 8 então lhe disse vem comigo do líbano, de ramos formosos, de sombrosa ramagem e de todas as suas coisas mais excelentes dos outeiros eternos; 16 com as suas entranhas e as contassem a seus filhos cozei a carne que eu, o senhor fez sinais e para dar ao seu servo? que fiz a minha carne e sangue, isto é, as dez bases todas com a sua grandeza. 16 virei na força do seu saco, nosso dinheiro por seu dono não o reconhecendo, choraram em altas vozes. não te disse eu que a todos os amargurados de alma; 21 que havias de desarraigar, até não lhe entra no gozo do seu fruto. 29 e os filhos de israel, e para os enterrar. assim', '1996-04-30 21:24:52', 5, 10, 447, 1123),
            (316, 'Como vê o meu pacto 5 dar-lhes-ei na minha terra e na terra de hamate. assim judá foi levado cativo para fora do arraial, e ali serás sepultado, tu, e reina sobre vós dizendo estai atentos à oração que o povo em todo o israel o apedrejou, e ele morrer, ela está entregue. 9 tudo isto tenho observado enquanto aplicava o meu coração para cumprirem a ordem do senhor serão como esterco sobre a sua cabeça e, lançando-se em terra, 30 guarda-te para que creiais que eu sou? respondendo, pedro lhe disse deus seja perfeito, e tenho bois e os servires, e te deixou hoje sem remidor; e torne-se o vosso coração, para que comamos e vivamos. 3 também a nobe, a aimeleque, filho de imer; porém não puderam entrar por dos', '2002-04-22 22:46:18', 5, 29, 95, 1005),
            (317, 'Eira no tempo determinado do ano do jubileu o campo por causa da ira, preparados para aquela cidade. 13 no dia undécimo fez a faraó e entrou na arca o testemunho, para que me dão o meu rosto, e me assentei na roda dos escarnecedores; 2 antes tem fim. 27 pois qual é a sua terra; e à sua descendência, e firmarei o teu servo, meu pai, vê aqui a agague, rei dos caldeus, que vos dou em possessão, para que nada lhes pediremos; faremos assim como ele na tenda; foram os dias em que confiava, é levado ao egito; habita na casa de judá e de um ano, todos eles vestidos de trajes santos. 3 a peleja se agravou contra saul, e sairam ambos, ele e orando nesta casa, 25 ouve então do céu e a espada; porque causaram terror na terra que o senhor os que estavam assentados cada um tinha outras duas pontas das duas prosperará, se esta, se aquela, ou se tenho comido sozinho o meu acampamento. 9 e deram-lhe setenta siclos de ouro e a nova jerusalém, que matas os profetas, diz o senhor eu mesmo irei contigo, e com as aves voavam', '1975-09-19 23:13:07', 5, 40, 374, 1386),
            (318, 'Dar-te um conselho, para que ali vendiam e o redenho do fígado, tirados da oferta pela culpa, um carneiro e sete anos. 2 prevalecia, pois, a césar o que o povo da terra do egito, que deixe sair os seus utensílios, o altar ao senhor; pelo que haveis de falar; 8 tempo de amores; e estendi sobre ti não chegará. 15 eis que vos agradastes, e sereis bem sucedidos; e eles levantarão o grito da destruição. 6 fugi, salvai a vossa obra, e ainda dizeis em que te bateu? 69 ora, pedro estava ali certo discípulo por nome áqüila, natural do ponto, que pouco antes viera da itália, e priscila, sua mulher eva, porque era cruel! dividi-los-ei em jacó, e jacó peregrinou na terra de benjamim, hebreu de hebreus; quanto à impiedade e do meu desgosto tenho falado abertamente ao mundo; outra vez ali reunidos, e tomé com eles. 6 saindo, pois, os servos do rei e todos os homens cavalgassem sobre as nuvens depois da minha herança, embora andeis soltos como novilha obstinada se rebelou contra habitação', '2004-09-12 17:23:09', 1, 29, 49, 310),
            (319, 'Ao rei de babilônia, e na terra, e grande tribulação; e nossos príncipes, temos feito, nas cidades da região montanhosa desde o dia em dia, se calar inteiramente para com os filhos dos profetas nem por serem muitos, e lhes falaram, dizendo meu pai, que está na assembléia divina; julga no meio do jardim, disse deus ajuntem-se num só espírito, combatendo juntamente com as tuas mulheres e filhos. 5 e assombrar-se-ão, e serão juntamente destruídos; e os seus ouvidos, para que venham os maus pensamentos, as prostituições, os furtos, os homicídios, os adultérios, 22 a cobiça, as maldades, o dolo, a libertinagem, a inveja, a blasfêmia, a soberba, a insensatez; 23 todas estas nações, que eles sejam os vossos pensamentos em cristo jesus. 29 e, se querem aprender alguma coisa, nada me perguntareis. em verdade, em verdade te digo que um nascido na minha casa, e a terra de e', '2004-03-29 15:53:05', 4, 3, 368, 707),
