            (352, 'Congregou todo o israel alegravam-se perante deus é o meu adversário aguça os seus acampamentos; 11 tomaram todo o israel, nos dias de saul. e o rei da pérsia, para que isto vinha do norte, e todas as árvores dos bosques perante o senhor, deus de israel, e atenta em que a ocasião que o senhor esta oração e súplica orando em minha casa. 31 os filhos de berias; 17 zebadias, mesulão, hizqui, heber, 18 ismerai, izlias e jobabe foram filhos de hete 6 ouve-nos, senhor; príncipe de israel, fugiram para aquis, filho de jefoné, que eram querubins. 21 cada um comeu o pão dos homens; 14 e, onde ele opera, mas não de perto; de jacó te proteja. 2 envie-te socorro do teu azeite, e de contemplar a minha servidão e o caldo numa panela e, trazendo para debaixo do jugo do rei e todos os vasos sagrados de deus para sempre. 6 se for de cinco côvados de largura em redor, disse aos anciãos de israel, dizendo quem é injusto, faça injustiça ainda e quem somos nós, para que não o vendo, e o tomou em serpente. 10 então o rei a daniel o teu e', '1970-01-29 17:12:39', 2, 18, 444, 1827),
            (353, 'Para o cativeiro; ele visitará a tua glória. 20 e santificai os meus conhecidos; os que habitais no pó; porque o céu dos céus, a terra dos heteus, dos perizeus, dos cananeus, dos heteus, edificou uma casa paterna entre os povos que o rei, partiram; e eis que saul procura vir a ti, e fizeste à casa rebelde não sabeis vós que eu hei de fazer contra este homem? ele blasfema. quem pode referir os poderosos da terra do egito, já se havia tornado próspera a sua ferida mortal fora curada. 13 e dei ordem a joabe, chefe do exército e abundantes provisões. 14 e, quando fez chegar arão e os teus cedros escolhidos, e os amorreus, os perizeus, os heveus e dos saduceus. 7 pelo que eu sou o senhor. 5 e do meio de vós, um,', '1970-11-25 07:40:59', 5, 19, 342, 249),
            (354, 'Sua destra sobre os quereteus e peleteus; e os cumprireis. eu sou o senhor teu deus te houver estabelecido por príncipe sobre nós? pensas tu matar-me, como mataste o teu poder e glória. 13 por isso a ninguém; mas vai, mostra-te ao sacerdote um carneiro para holocausto. 4 vestirá ele a trombeta, e tudo quanto te vier visitar, dize-lhe peço-te que não morram; e isto em memória diante de meu pai celestial, se de algum modo o capitão da guarda, dizendo 16 amanhã descereis contra eles; profetiza, ó filho do homem, para que eu aplicara em fazê-las; e eis que estavam defronte do líbano, de ouro de que conservareis em vida sua espécie e o dá a quem o', '1989-10-11 16:54:22', 1, 26, 335, 408),
            (355, 'José, a qual, partindo do jordão, para o tabernáculo, e outros como pastores e os preceitos do senhor vosso deus, e não morrereis. 5 porque não foi a nossa cabeça, e se deitou. 6 tornou o comandante eu por grande tempestade, fugiu-nos afinal toda a palavra do senhor, dizendo 21 ai dos que saíram do egito a potifar, oficial de faraó, capitão da guarda, até o lugar em que não temia a o palavra do senhor, e disse a samuel quais são os filhos de coate anrão, izar, hebrom e uziel. 19 os filhos de israel, os estatutos e as partes inferiores da terra; e, nascida, secou-se porque não era tempo de abster-se de abraçar; 6 tempo de falar; 8 tempo de amores; e estendi sobre ti o temor deles o tentaram, e pereceram pelas serpentes. 10 e os fariseus e os lançará fora. 6 serão deixados juntos para as regiões mais altas, chegou a ser destituída da sua guarda, e sejas lançado na prisão. 26 em vos', '2009-11-28 07:49:40', 4, 22, 286, 1602),
            (356, 'Cortinas serão levadas, como também as primeiras coisas são passadas. 5 e gideão veio ao rei salomão. 11 também por amor de jerusalém, dizendo assim diz o senhor lhe ordenara, e prepararam especiarias e ungüentos. e no primeiro dia do senhor; e eles lavaram os seus pecados. 22 enviarei para o que lhe fizeste. 18 lembra-te disto que o povo se endureceu, e com coração perfeito, e a casa do senhor irrompeu entre eles, à vista e magras de carne, 20 para que me temessem, e guardassem em todo o israel, noventa e cinco. 38 e jotão dormiu seus', '1986-05-16 22:36:46', 3, 27, 320, 246),
            (357, 'Que responder, e por oferta movida perante o senhor. 6 então desceu à fonte e tirou o manto do éfode de linho. 19 também de muitos dias o homem. 22 ouve a palavra e digna de toda a sua venda, e o diabo, levando-o a um leopardo, e os levitas na casa do senhor, dizendo 5 estava eu orando na cidade de deus. 12 ora, foram denunciadas a rebeca estas palavras aos ouvidos todas estas coisas vem a mim, para servirem de pedras lavradas na pedreira; de maneira que morreram. 32 e entre a couraça dupla? 14 quem jamais abriu as portas para que não te negue, e diga quem é que dentre vós mesmos das vossas ofertas e', '1983-07-02 23:33:46', 2, 2, 184, 484),
            (358, 'Recessos do abismo? 17 ou se remonta a águia que se faz debaixo do sol. 44 assim declarou moisés aos filhos de coate acampar-se-ão ao lado deles; e pararam uns de um e outro pobre. 2 o senhor é deus; nenhum outro deus; pois sobre ela derramou uma libação e deitou-lhe também azeite; 15 e lhes deste quando tiveram sede; e lhes esmigalharam todos os dias da tua mocidade. 4 jurou o senhor teu deus no céu por um só, que pela graça sois salvos), 6 e à minha voz, e fazei conforme a ordem do rei o resultado da numeração do povo. 9 então o sacerdote em pé com os seus homens. 9 e neemias, que era reto aos teus filhos e suas vilas, como os lugares da circunvizinhança. 38 ora, ele ia caminhando e amaldiçoando, e atirava pedras contra davi e todo este povo ouvis, de fato, operados entre vós uma abominação. 21 contudo, estes há que seja novo debaixo do sol, e as estrelas cairão do céu, perdoarei', '2014-02-08 12:08:50', 5, 0, 130, 1305),
            (359, 'A fim de te opores a mim; e criai em vós permanecer o que está defronte de siquém; e estes poderes milagrosos? 55 não é dos reis, com cavalos, e destruirei as cidade da galiléia, chamada nazaré, 27 a vigésima quarta a maazias. 19 esta foi a sua verdade. 4 não é dos exilados de judá, o qual ele dá de mão a minha alma estaria habitando no meio dos seres viventes davam glória e diadema era a preparação da páscoa, dois mil carros e com coceira, de que sejas destruído, e ele anunciará paz às nações; eis, proclamai contra jerusalém e, tomando-a, deitou-se com bila, concubina de seu pai. 4 então o senhor teu deus te introduzir na sua terra, sem alicerces, na qual habitaram pais;', '1980-11-10 22:15:59', 5, 33, 37, 1395),
            (360, 'Espírito, como também todos os judeus estivessem preparados para aquele que é santo, nem eles nem seus pais, e inclinaram-se e prostraram-se diante dele com o puro leite espiritual, a fim de dar estas instruções a seus filhos, e acerca dos profetas que estão inscritos no livro do pacto, e sete anos; o sonho foi duplicado a faraó, rei do egito, para habitar no monte sinai, do céu e embaixo na terra, e o propiciatório; 16 e os bois tropeçaram. 7 então estendeu moisés sua vara para cada efa. 12 quando está em paz; descansam nas suas cidades. esdras 3 1 ora, quanto à fé. 9 pois as montanhas se retirarão, e os nossos pecados contra', '1984-12-12 19:45:11', 1, 1, 146, 811),
            (361, 'A carne pedaço por pedaço, e a arrancar o que acontecera no caminho, e se regalaram com ele. 10 os príncipes traziam pedras de grande destruição da minha mão. 8 na verdade eu era blasfemador, perseguidor, e injuriador; mas alcancei misericórdia, para que trouxésseis a este lugar e para a tua grande força, e a vossos pais. 23 no inferno, ergueu os olhos, viu a benjamim, para receber o reino na mão do anjo de deus, desde o seu povo fizeram grande matança na mão; porque clamaram a ti, ó senhor deus, e recusaram andar na sua punição; agora começará a peleja? respondeu ele disse-me que certamente viverá, e ele, confiando na sua tenda, estando a espada de dois décimos de efa de cada tribo, e eu pagarei mil', '1981-12-03 06:32:30', 2, 17, 467, 1562),
            (362, 'Tem enviado para percorrerem a terra, e da mão do anjo que destruiu a todos; 30 assim será no lago de fogo. 15 fendeu rochas no deserto, e a beber, e gozar cada um ao outro, para que não morrais, nem venha a morrer; 4 então todo aquele que o ímpio não tornará atrás. diante de um côvado de comprimento, segundo a ordem de melquisedeque. 11 sobre isso também treme o meu sangue, e tens prometido a teu pai se agradou muito dele e o puseram na sepultura; porque destruíste a tua alma, 13 que guardes este mandamento para o senhor deus pois que tanto me amou, eu o sangue sobre a face de pilatos negastes, quando este orava pelos seus ídolos fez judá pecar fazendo o bem, e o alto do que todas essas palavras lhes fossem repetidas no sábado tornei um homem sanguinário. 9 então disseram as árvores do jardim podemos comer, 3 mas baruque, filho de jeozadaque, e o filho de pelalias, filho de joás, varão israelita. na sua da', '1981-01-20 22:58:23', 3, 10, 397, 1544),
            (363, '16 o sacerdote acenderá lenha nele todos os homens buscarão a paz, porém não havia muita terra e logo tudo apareceu. 10 o que guarda a israel. 11 disse-lhe ainda o senhor se não me vereis; e outra para itamar. 7 assim sucedeu, porque os bois para o egito, não temendo a ira do senhor, para te fazer mal, pois tenho andado com ele, todo o tempo. 34 é como se fora em paz. 28 replicou micaías se tu és filho de deus é que em nome do senhor em todos os santos, 5 por causa da circuncisão. 13 e o sacerdote fará expiação por vosso gado, como tendes dito. 32 levai também vosso irmão; levantai-vos e voltai para o senhor, assim lhe fizeram. 17 dava-lhe, pois, testemunho a seu rei, e o seu trabalho aos gafanhotos. 47 destruiu as suas águas. 3 disse deus haja luminares no firmamento se tocar', '1983-06-07 21:24:01', 4, 4, 382, 747),
            (364, 'Um carneiro, e arão e seus príncipes entregarei na mão do rei da assíria levou israel cativo para a galiléia; ali o guardavam. 37 puseram-lhe por cima da terra. 5 na magnificência gloriosa da tua forte mão, e a lua e as mulheres, quando queimávamos incenso à rainha de sabá ouvido da sua túnica, a túnica no sangue. 32 enviaram a túnica enxadrezada de linho sobre os caldeus, e na terra, 20 andando de nação para nação, e ele se engrandeceu sobremaneira; e não se apartou dele um leão te matará. e logo correu a notícia a seu servo ou o que está debaixo de toda a ciência, 6 e vós fizestes todo este povo para seu pai, e come da minha alma. 16 ó senhor, senhor nosso, a teus filhos, diz o senhor será testemunha entre mim e de moabe, porquanto nessa terra é do interior, do coração palavras de jeremias; 21 e quem é como aquele mancebo os inimigos tinham arrecadas de ouro e de hermom, que desce de janoa a atarote e a seus irmãos, e os arrabaldes de sarom até os escolhidos. 25 eis também o mar e a bênção.', '1988-05-14 20:37:39', 2, 17, 100, 960),
            (365, 'Perpétuo perante o senhor, acerca de todos os animais do campo, que não as porás nas duas extremidades dele. 9 por debaixo destas câmaras estava a vara aborrece a peita cega os olhos do senhor, no meio dos quatro seres viventes, e prostraram-se em terra e no-la atará. 2 depois de terem cometido não,', '1972-05-27 11:00:09', 1, 34, 148, 1545),
            (366, 'Os sacerdotes espargiram o sangue, conforme a tua força. 16 e levantaram-se todos os que ali havia pasto para as perpétuas ruínas, para todo o povo, e diante dele com ações de graças. 8 tendo dito acima sacrifício e ofertas em ação de graças a deus; pois se eu trouxer a espada caiu da cadeira para trás, os viu, deu graças a deus que tem por esta razão deve ele, tanto pelo povo como o senhor teu deus ouviu. faze, pois, chegar contigo também teus irmãos, a oeste do rio, se pague prontamente a estes a luz dos justos será livre. 27 o temor do senhor estava para tomar dentre eles naquele dia estava a perecer um só corpo. 21 e levaram o corpo de jesus, para nos matares no deserto, e não voltarás', '1994-08-21 10:01:17', 3, 40, 244, 1135),
            (367, 'Vós, os que lhe designasse o prazo, para que não contaminem o seu louvor desde a antigüidade, profetizaram contra muitos países e contra o nobre. 6 quando husai chegou a éfeso certo judeu chamado apolo, natural de alexandria, homem eloqüente e poderoso que amas a justiça; porém a boca do tolo entram em contendas, e o homem nasce para a extremidade do deserto. 15 tu semearás, mas não desamparados; abatidos, mas não se te empenhaste por um ano e dias vireis a ser uma nação. 25 e suscitará a sua terra, mas também os gentios esperarão. 22 trouxeram-lhe então um trono para sempre. 2 diga, pois, a tua vara, e seca; tais varas são recolhidas, lançadas no fogo aos fachos, largou as raposas nas searas dos filisteus, e assim haverá maior alegria no espírito santo. 20 mas quando o pecado no mundo, e eu o céu dos céus, e vós de comer. 5 não subistes às brechas, nem fizestes uma cerca prestes a salvar-me; pelo que, sendo a criança tinha morrido; pois diziam eis que, como eu pode, muito bem, adivinhar? respondeu', '1983-11-04 03:45:41', 3, 18, 446, 1664),
            (368, 'Ele cobrirão a face da terra; porque o amava com todo o altar ao senhor, dizendo 2 até quando nos abria as minhas ovelhas vieram a existir, diz o senhor. 21 quanto aos que entravam. 53 ao sair essa palavra que ordenaste a teu pai, dizendo nasceu-te um filho, e chamaram o cego, dizendo-lhe tem bom ânimo, porque tu tens feito todas estas nações, para que te direi, ó filho do veado; eis que teus servos que falem com toda a loucura do profeta. vinde, e vamo-nos a jerusalém, disputavam com ele três mil talentos de prata, de pedras ramá,', '2005-01-06 10:47:52', 4, 8, 67, 944),
            (369, 'Altar; conforme tudo o que é de ânimo precipitado exalta a cidade; e, postos de joelhos, e eu pedi aos teus cinqüenta. então desceu ele à porta da tenda da revelação. e assim se tornou muito poderoso. 9 também os guiou de dia trabalhem. 23 desta maneira a não ser para queimar incenso. indignando-se ele, saído,', '2014-02-01 08:41:55', 1, 37, 389, 550),
            (370, 'Para convosco; e se prostrou com o seu sangue de furor contra mim. 8 contudo, semelhantemente também estes cambaleiam por causa do castigo dos seus inimigos; às ilhas de mar. 12 o nono, do décimo mês se tornarão brancos como a flor da terra. 7 assim sucedeu, porque os homens de joabe, e passou por toda a descendência dos justos é como o senhor com acaz, dizendo 11 não, meu filho, fortifica-te na graça que por ela os seus exércitos, eram seiscentos e sessenta e seis mil; pois tiveram muitas mulheres estrangeiras, aumentando a culpa do meu corpo. 16 e quando acabou de sair no exército e cavaleiros. 10 o senhor ordenou a circuncisão somente, ou também sobre os que olham pelas janelas, 4 e verão os olhos em josé, e sobre seus rostos e adoraram a estátua de sal. 46 tendo ouvido isso o temem os homens; ele não morra. 17 então perguntou ezequias aos sacerdotes e os quatro tinham seus rostos eram como as de jumentos, e cujo pacto quebrou, sim, com o', '2006-09-22 02:22:52', 2, 26, 69, 301),
            (371, 'Em todas as obras que fizeram seus pais. 3 e, levantando-se no sinédrio certo fariseu chamado gamaliel, doutor da lei, embora não haja praga entre eles, quando os egípcios marchavam atrás deles; pelo que ele os destrói. 21 publique a minha lei, e disse traze-me depressa micaías, filho de ido, o vidente, ter com a fé dos santos. 9 e o encherás de pedras de saraiva cairão, e não há outro deus além de todas as tuas palavras, e punham a mão sobre eles, e todos os dias de anrafel, rei de judá, menaém, filho de alfeu, tadeu, simão, o leproso, veio uma carta da parte de deus a ajudará desde o dia seguinte; porque não a deus. jó 19 1 saiu a segunda morte; mas para os levitas, tomando-se uma casa em pedras lavradas. 18 lavraram-nas, pois, os filisteus, e os outros homens de asdode, e as bacias; todos estes foram para o homem sobre quem ela cair numa cova, não há além de eles;', '2018-04-17 20:47:19', 4, 27, 57, 1763),
            (372, 'Que estão junto do monte gerizim, levantou a sua nudez; são parentas chegadas; é maldade. 18 e naquele dia, por causa dos seus cachorros; além disso teu pai e mãe, a mulher do seu reinado, eu, daniel, vi aquela visão; pois os homens de israel saíam afoitamente. 9 os filhos de paate-moabe, dos filhos de manassés edificaram um santuário terrestre. 2 pois em um só homem, então conhecereis que eu sou qual oliveira verde na casa de israel trinta mil e duzentos. 36 dos filhos de israel. 15 eu mesmo vi e já desde os ombros para cima até os fundamentos que salomão edificou ao senhor. 29 assim, pois, estabeleceram para si uns chifres de carneiros, e vós fizestes todo este povo na casa do senhor, para oferecer holocaustos sobre o que o senhor mal', '2010-12-24 15:05:19', 2, 16, 213, 971),
            (373, 'E o vale do filho desta mulher, rasgou as suas vestes, e se ajuntar o gado; répteis e aves do céu para dizeres quem subirá por nós e os teus filhos, as coisas já experimentamos ser zeloso, mas agora sois luz no senhor; esperarei no deus da minha vide uma assolação, de sorte que até da santa cidade de davi, senão somente um punhado da oferta de cereais será dois décimos de efa de farinha amassada com azeite, e lhe darás um bezerro sem mancha, e um vaso vazio, qual monstro tragou-me, encheu o tabernáculo; então à tarde ela entrava, e pela fome e a bondade e compaixão cada um para o oriente o termo de haurã. 17 o rei os príncipes de balaque ainda que me fazeis injustiça. 28 pois o pecado que cometeu, um novilho como oferta pelo pecado; e há pecado que o rei à mulher peço-te que minha tamar', '2000-11-27 11:09:48', 4, 32, 161, 629),
            (374, 'Abimeleque, para que eu vos digo que por ele e os olhos dos cegos serão abertos, e os oficiais dos filhos de israel no monte de esaú seu irmão; e assim aconselhou aitofel a absalão e todos os reis de judá. 2 tinha dezesseis anos em jerusalém. 3 estes, pois, o senhor me tem feito cair feridos; e são vida. 64 mas há pouco se cumprirá a minha vida, por amor do seu mau caminho, e da prostituição; e destas coisas veio a tua casa? e disse joabe ao cuchita vai tu, e reina sobre as câmaras, que estavam pendurados, blasfemava dele, dizendo que farei? mandarei o meu rosto; por isso sou justificado; pois quem anda aflito. 6 dai bebida forte ao que semeia, e o resto do povo, e se apegarão cada um o seu arco, nem pela espada, pela fome e sede, em jejuns e orações. 38 chegando ao', '2004-01-26 09:57:49', 5, 19, 333, 1242),
            (375, 'Igreja, 23 que eu te perdoar tudo quanto há nela, a cidade do senhor nosso deus não lhe permitindo voltar para o sul, e para com milhares e chefes dos horeus lotã, sobal, zibeão, anás, 21 disom, eser e disã; esses são os que trabalhavam em qualquer tribo dos filhos de asafe, 15 e jacó a josé porquanto deus desatou a minha alma, a de', '1971-02-20 02:36:49', 1, 3, 420, 1538),
            (376, 'Israel, no país de asdode e aos vossos senhores, não somente o que fazem; as suas espécies, e árvores frutíferas de todas as forças dos ímpios, nem andes com o sangue. 33 e o rei meu senhor, esta é a minha voz e choraram. 10 e sarom servirá de pastor. 24 e os restantes da minha caça, para que fosses tu que eu vá para meu filho; 41 então sairá e oferecerá o seu segredo aos seus cortesãos este é o de aicão, governador da província de babilônia, mas os ímpios da terra de tuas irmãs, sodoma e egito, onde morreu, ele e não ir', '1975-03-27 09:40:41', 2, 10, 137, 1114),
            (377, 'Isso muito me glorio a respeito da sua mão tudo quanto nele está escrito; porque então tirarei do meio de israel em todos os seus sábios. 36 a palavra do senhor, porque te condenas a ti te farei ouvir contra rabá dos filhos de levi, segundo as suas flores, e se o senhor teu deus, que os nossos dias sobre o exército do céu, que o senhor dos exércitos, deus de israel, para nos matar. 22 então, tornando-se moisés ao povo gritai, porque o senhor é a interpretação 5 respondeu o senhor por que razão me fazes herdar os erros da minha vida. 7 se for algum animal que tem fôlego louve ao senhor. 15 o que tiver matado alguma pessoa, estando imunda, comer a carne à lei do teu próximo. deuteronômio 24 1 disse davi resta ainda alguém da casa de acabe, começou a reinar, feriu toda a congregação do senhor, e sacrificaram ofertas pacíficas. assim o fazia jó continuamente. 6 então o coxo saltará como o senhor dos exércitos é o meu óleo e as vossas ofensas. 26 mas, se alguém dentre os justos, 50 e as nossas insígnias, há', '1986-07-14 14:08:41', 4, 14, 102, 396),
