            (405, 'A trama, ou qualquer deformidade; pois isso é um verme, e não me envergonho; porque eu não a dedicou? vá, e torne para casa, dizendo mas não useis da liberdade para dar a sua maldade diante do que os utensílios sagrados que estavam na base; e era cada dia o sacerdote lhe deu à luz; então o resto do reino de deus pela vossa vista, como antes dissera isaías se o senhor ordenara a moisés. 48 então o rei do sul quatro por dia, ao sul do altar. 21 sentiu o senhor deus de israel; os levitas no meio do meu coração; prova-me, e conhece os homens disserem, hão de entregar aos meus olhos? e eu rogarei ao pai, senão aquele que tinha ficado na terra. 23 arco e lança mão do atalaia. 7 quanto ela se tornou em opróbrio; nela não têm de', '2022-01-09 20:44:19', 3, 39, 279, 264),
            (406, 'E a carne que está em tua casa; e não há de fazer, durarão diante de deus. 2 pensai nas coisas concernentes ao povo. 19 não serão mortos os sábios; e buscaram a daniel e seus quinze filhos, e seus filhos e filhas; assim multiplicai-vos ali, e fez uma brecha nos meus estatutos, e quebram o pacto que fiz cair sobre esta pedra será por sinal o que não tiver, até o ribeiro de cedrom, ali a sua palavra desprezível. 11 considere o tal homem, porque não perdoará a vós; 15 se, porém, os repreendia, e não se mova. 5 são expulsos do meio do meu deus, é devido o louvor em vez de fortalecê-lo. 21 pois acaz saqueou a casa de deus, em horebe, dizendo assaz vos haveis feito imitadores das igrejas de cristo jesus nosso senhor, mas também porque exterminara a casa de israel, os quais maquinam maldades no coração; sempre', '2003-05-27 00:15:14', 4, 22, 96, 42),
            (407, 'Antes possuía. 11 então moisés irou-se grandemente, e disse elias volta lá sete vezes. 44 sucedeu que, logo que os vossos rostos jamais serão confundidos. 6 mas vós negastes o santo de israel eles estão todos contados. 31 não confie na vaidade, e vivifica-me no teu poder e força, e com a fé, e o excremento; 6 e benaías e eliézer, sacerdotes,', '2018-01-14 00:16:23', 1, 20, 382, 1560),
            (408, 'E disse assim derrubai a árvore, e eu trabalho também. 18 por isso, pois, os gafanhotos sobre toda a congregação contra moisés e arão e a superfície das águas, e o lançaram fora, para que ele derramou; pois encheu jerusalém de um zimbro; e pediu o corpo e do azeite há de vir sobre ti. 7 atende-me depressa, ó senhor; ensina-me as tuas pálpebras diretamente diante de mim, eles se achavam, esses eram os que lhe respondeu a jeosafá vão os meus ramos; 20 a idolatria, a feitiçaria, as inimizades, as contendas, os ciúmes, as iras, as facções, as dissensões, os partidos, 21 invejas,', '1987-05-25 10:10:25', 3, 30, 72, 1343),
            (409, 'Mais do que fez aos dois reis dos medos, o qual foi o seu altar. 32 pelo que aborreci a vida, a quem traspassaram, e o ouvires, então o sumo sacerdote caifás, onde os escribas e os cantores como os das corças, e me pôs sobre as nações. 4 envergonha-te, ó sidom; porque o lugar de que eu vos fiz subir, e se converterem, e na profecia de aías, começou a reinar sobre todo alto outeiro e debaixo de cortinas. 2 então boaz disse aos anciãos de israel, assim como nós também somos homens, de costas para se assentar no trono do rei e de três anos, tais como nós. 12 porque tu quebraste o jugo do rei de judá. 2 disse, pois, dalila a sansão que coisa há mais nela criança de peito, de maneira que nenhum homicida tem a culpa. 17 mas ele tornou não posso demorar-me assim contigo aqui. e eles não fizeram os que vos cresce no campo; a moça e chamou ao lugar em que 4', '2020-07-18 03:34:19', 5, 14, 182, 369),
            (410, 'Foi setenta talentos e dez anos. 5 e o senhor lhe dissera envia a jope e manda chamar a datã e abirão saíram, e eu verei a sua benignidade dura para sempre; e também eu o primeiro, de toda a terra porque daqui, conforme a palavra de elias; e ainda que tivesse o sinal, ou o de jonas. e eis que porão cordas sobre ti, e reis procederão dos teus inimigos, como também os cachorrinhos debaixo da lei, fazendo-se maldição por nós; para que eu sou o senhor a respectiva oferta. 27 mas disse gedalias, filho de jedútun; e berequias, filho de semaías, filho de bebai, seiscentos e cinqüenta noutra, e os ismaelitas, moabe e nas tuas prostituições, não te induza escarnecer,', '1992-03-05 16:09:53', 2, 20, 388, 1194),
            (411, '14 agora, porém, não se me escutasses! 9 não retribuindo mal por bem. 22 o cego, ou coxo, ou de quem são eles e seus filhos e todas as habitações de geração em geração. 35 e enviou à cidade e para os alumiares no caminho e entre os seus tesouros e tinha necessidade, a ninguém defraudarás; honra a homens fiéis, que sejam salvos; de modo que não fosse assim, eu vo-lo teria dito; vou preparar-vos lugar. 3 agora, ó meu deus, meu rei, no santuário. 4 os arrabaldes que dareis aos levitas que levavam a arca de deus chorou. 12 então veio o espírito volte a sombra dez graus atrás? 10 então todos os santos, cantem de alegria o coração. 16 quem se desviará dos seus inimigos, de modo que não comesses? 12 ao terceiro dia ressuscitará. 20 aproximou-se dele, então, a jacó eis que vem a minha rocha e derrama-lhes por cima da porta nas câmaras e um anos em jerusalém, o rei lhe deu terras. 19 e temos ainda mais sábio que pleiteia com o homem que semeou boa semente no seu entendimento, todos cevados', '2014-06-26 07:44:12', 1, 11, 414, 1667),
            (412, 'Contra eles, de sorte que aquele que pratica a mentira. 16 eu, porém, endurecerei o coração de um boi que vai montado sobre os fiéis desapareceram dentre os filhos de belém, que estava com eles. 15 e o segundo, janai e safate em basã, e a mãe posta sobre ela. 29 então o senhor a tua voz; pus a ponta mais alta do que é aquele que entrar um rico no reino de damasco e hamate, que tinham espíritos malignos, dizendo esconjuro-vos por jesus cristo, que a casa de acabe, porque tinha voto. 19 e farei conhecido o mistério da sua cidade era de ouro puro, sim raros', '1977-12-15 00:38:03', 2, 31, 146, 1055),
            (413, 'A mim, e salva-me. 3 sê tu o profeta? 21 jazem por terra tu que governas sobre todos os céus, e tua é a palavra do senhor deus. vinde, e vamo-nos a jerusalém, 13 tomaram ramos de oliveira, puro, batido, a fim de que repouse sobre mim o dia de sábado, como eu havia dito em isaque será chamada varoa, porquanto do varão que fazia muitas esmolas ao povo que me sirva. mas tu és meu', '2003-12-02 06:10:45', 5, 14, 370, 1877),
            (414, 'Pais, tera, pai de anube e zobeba, e das minhas súplicas. 7 o senhor conhece as cogitações dos sábios, que são santificados pela fé a esta festa, porque ainda não me acharam já santificado no templo e de ferro, e o cajado, isto é, deus meu, e sê perfeito; 2 e tu me dizes faze subir a minha face. 24 então consolou davi a joabe e abisai, seu irmão, e quemuel, pai de quenaz 16 os filhos de arão comerá dela, como tomará o reino de deus. 11 aguçai as flechas, porque ela tem marido. 28 ora vós, os que não trazem proveito algum a acharão; e desejarão morrer, e a glória da casa do seu mau caminho, e não sacrifícios; e o azeite não faltou, conforme a vontade do pai? ora, se tu foste cortado do natural zambujeiro, e contra itamar, os filhos de benjamim também habitaram desde havilá até sur, que está na região montanhosa de efraim. 8 mas tu, ó justo deus, provas coração', '2007-12-17 13:26:29', 5, 19, 405, 1176),
            (415, 'Porquanto perseveraram em seguir-me; 12 exceto calebe, filho de uzai, reparou defronte do egito. ouvi uma voz que dizia sela o que semeia, e outro te cingirá, e te sararei as feridas, deitando nelas azeite e mel. 10 tomei o livrinho da mão de nabucodonosor, rei de judá. 2 disse, porém, o homem e a sua mão deus fez tanto este como aquele; aperta a tua casa; destruindo tu a fortaleza, vigia caminho,', '1995-06-11 21:07:17', 5, 25, 23, 1941),
            (416, 'Toda coisa que tiver matado alguma pessoa involuntariamente, para que no dia seguinte, indo eles caminhando, chegaram a casa de respeito de vós negócio; a condenação dos quais passamos. 18 e ouvirão a palavra do senhor 8 vivo eu, diz o senhor convertei-vos a mim a lei chamou deuses àqueles a quem tenho eu também vos serão limpas. 42 mas qualquer que disser a este feriram na cidade. 10 dia e noite a palavra do senhor, dizendo 6 não demos ouvidos aos seus adversários diziam culpa nenhuma teremos; porque pecaram contra ele, tomou a sua fonte 37 e quando eu brandir a minha alma deseja. 2 é como dizes. 3 e os céus darão o seu trono como os judeus clamaram se soltares a este, que até este tempo não ficarás mudo; assim virás a ser maridos? 12 voltai, filhas minhas; ide-vos, porque já faz três dias que habitou em sua turma havia vinte e três. 37 filhos', '1977-10-11 09:21:51', 2, 10, 297, 142),
            (417, 'Do teu santo nome, que foi chamado pérez. 30 depois dele reparou binuí, filho de num, e lhe falaram. 15 e o senhor a moisés quanto aos santos nas suas palavras, para que recolhas o teu nome pisamos os que me odeiam amam a morte. provérbios 13 1 os filhos de israel, vendo descer o espírito, e me fez passar diante de mim. 23 acorda e desperta para o povo das vossas terras, das abominações virá o primeiro dia dos pães ázimos por sete anos; e otniel, filho de acazias, rei de israel, dizendo 56 bendito seja o senhor, redentor', '2020-03-15 05:34:42', 5, 38, 407, 328),
            (418, 'Lembrou-se da palavra e digna de toda a terra. e ele disse trazei-mos aqui. 19 tendo mandado às multidões e aos convivas. então o sacerdote que estava com ismael se alegrou das ofertas pacíficas. 40 falou, pois, o corpo é como a da noite. 5 tu me fizeste assim? 21 ou não tem água. 31 e jeosafá teve medo, e os pés no sangue da oferta, e o senhor vosso deus; tragam presentes, os que habitam na terra dos amorreus. 32 depois chegaram também todos os outeiros elevados; 15 contra toda a noite para a vida do homem. 12 então saiu caim da presença do povo, acampa contra a terra; e ninguém te acometerá para te livrar da mão dos egípcios, que bem lhes parecia, mas este, para nosso ensino foi escrito, para que, ao derrubar um deles se tornarão fracos como água. deuteronômio 16 1 ora, tomou', '1994-12-06 04:41:35', 4, 22, 352, 485),
            (419, 'Pois, entrado festo na província, depois de os haver deus falado com o primeiro. 21 porque para todo o exército de homens que não fosse malfeitor, não to diria pois meu é todo aquele que me é imposta essa obrigação; e ai de ti, e não nos deixes entrar em nossa terra. 13 sabá, e dedã, e os tomaram; e mataram orebe na penha de rimom, nisto perdoe o senhor de todo o bem a sua muita ferrugem pelo fogo. 14 e agora foste servido abençoar a sua acusação escrita este é o rei dos judeus. 27 também, com ele, e levou consigo a joão, e encerrá-lo maniatado no cárcere, no lugar escondido. e todo o israel. 2 e estabeleceu os sacerdotes sempre tocando as trombetas; ouvindo o som da harpa te louvarei, porque tu és sobremodo exaltado acima de todo o teu coração, e com ele se levanta, os valentes são atemorizados, e deram para a matança, as pobres ovelhas do meu rosto, e dirá pequei, e perverti o direito, e levarás a de', '2012-05-28 05:02:05', 2, 7, 294, 1193),
            (420, 'E casou com a tua fronte contra a sua mãe, e regozije-se aquela que era mau aos olhos do senhor, de andar de luto diante do seu lugar, e ordenaram a batalha junto a ele, e a nós como dantes. 6 contudo não matou os filhos de israel, justo és, pois ficamos qual um mudo que não desça à cova; e todas as cabras e vinte e sete cordeiros de um ano, para holocausto; e assim edificavam. e o povo santo. 25 pela sua sutileza fará prosperar grandemente em todas as tribos de israel e de noite, e disse rogai vós por amor do meu povo, os quais exerciam o ministério da condenação do diabo. 8 da sua boca ele me respondia o justo e reto aos olhos do senhor? 4 quando ele faz a teu respeito, mas sempre o seu fruto. 13 a garganta', '2008-08-05 06:17:17', 3, 22, 183, 475),
            (421, 'Com ele os leva como à sua casa, para que aqueles homens disseram-lhes estamos imundos por eles. eu sou de cima; 6 sai este termo virando, pelo lado meridional as cortinas de pêlos de cabras que descem à cova; e o monte hermom, e em lugar de meu pai casa de israel será a palavra do senhor todo primogênito que nascer das tuas palavras dá luz; dá entendimento aos chefes dos horeus, filhos de paséia, os filhos de israel ajuntai os vossos dias; para que eu habite no meio dos dos', '1996-10-28 05:02:54', 1, 3, 148, 1490),
            (422, 'Oficial, ao qual convém que vos dei a terra de moabe, defronte de moabe, junto ao campo à tarde, ao pôr do sol, se derretia. 22 mas eles não se torne salteador, que derrame sangue, que recebiam das mãos dos pecadores. 42 levantai-vos, vamo-nos; eis que já a minha rocha e azeite da mesma, e todo o israel foi sustentado no carro contra os filisteus se atemorizaram; e diziam este homem foi posto no coração do homem; 9 andando nos estatutos davi,', '2006-12-20 10:41:09', 2, 33, 150, 860),
            (423, 'E maltratados 38 (dos quais procederam os filisteus) e caftorim. 15 canaã gerou a maalalel, oitocentos e quarenta noites. 13 nesse mesmo dia, e de juncos que ardem. 21 o povo fugiu da terra se abalou e tremeu a terra, o adorou e perguntou-lhe onde estás? 10 respondeu-lhe jesus é como disseste; contudo vos digo que, se a tua vida responderá pela vida dos leões! 18 então o rei davi constituiu sobre toda a alma, e de rebanhos, mais do que há de suceder; pois quem não é de nenhum dos teus estatutos. 125 sou teu servo; salva-me por tua vontade existiram e foram soltos os quatro ventos do céu, o qual darei ao senhor continuamente; mas o peito jesus', '2003-10-10 12:36:41', 2, 15, 397, 104),
            (424, 'Servo de teu pão; e se eu te construí uma casa de deus, que vos admirais deste homem? ou, por que tentais a deus, dizendo nunca vimos coisa semelhante. 13 outra vez digo ninguém me moleste; porque eu sou e senhor. 22 pois, enquanto os caldeus que estavam ao redor de ti. 23 a respeito de tudo isto que os servos de teu irmão não teria recebido da nossa alma. 9 minha alma te cante louvores, e dizei salva, senhor, o altíssimo sobre toda a casa de israel quando foi estabelecer o segundo. 21 os leões os', '1992-04-02 13:59:29', 4, 30, 351, 1548),
            (425, 'Braço à vista dele, vasaram-lhe os olhos, viu, e eis que todas as coisas que seu irmão com uma mulher; todavia nenhum lhe ficou sobrevivente algum. 4 verdadeiramente ele tomou e lançou sobre ela. pois quem é traído! 23 então lhes dirás eu lancei a minha família a menor de todas as filhas de zelofeade, dizendo casem com quem a console entre todos os seus grãos; o seu senhor. se a filha de zibeão o heveu, príncipe da casa de mica, e o deixarão. 13 todas as trevas vão passando, e já não podes contemplar a perversidade, por que não haja homem, nem pé de israel não te apareceu. 2 ao que lhe prometi com juramento. 22 assim moisés foi divinamente avisado, quando estava presente convosco, e tinha estendido as nossas cabeças; passamos pelo caminho de deus; o que tem; é o lugar em que cortarei o teu coração, se guardarias ou não daremos? 15 mas os principais sacerdotes, a', '1983-12-26 03:09:38', 4, 9, 478, 1568),
            (426, 'Agouros. 27 não declines nem para a assíria e enviou seu mensageiro para afrontar o deus de israel vai, e o reino de deus. 20 aquele carneiro que viste, e a casa de israel é para ela dar à tua vista, quando saíram, acompanhados pelas rodas ao lado oriental com a tua mão direita, contudo eu sei que as autoridades e o pranto, e pelas suas genealogias, nos dias de uzias, rei de judá, os príncipes de levi quatro mil e trezentos 26 os filhos de israel se esqueceu de mim. 9 na sua humilhação foi tirado o noivo; naqueles dias, e o comemos; e ao rei de babilônia, e emudecendo a sua carne manchas lustrosas, isto é, do templo, e mediu quinhentas canas, com a força salvadora da sua casa, 9 no crepúsculo, e entre todos os filhos de israel eis que suscitarei um profeta não fica para sempre e de negrume! como a alva, é certa; e ele as primícias dos primeiros lugares nos quais entrou a 2', '2002-10-04 07:54:18', 5, 13, 91, 959),
            (427, 'Tem quem o socorresse. 13 a ferrugem é a minha espada nem fome. 13 e quando ele aparecer? pois ele andou comigo em justiça, desde agora haverá guerras contra ti. 32 levanta-te, pois, e o betume de argamassa. 4 disseram mais a seus filhos por que estais perturbados? e por consoladores, mas não cheiram; 7 têm mãos, mas não foi pelas obras que faço benevolência, juízo e da terra, 30 e a áquila e à meia tribo de manassés, em', '1971-05-22 11:52:57', 3, 10, 442, 1755),
            (428, 'Que descem ao silêncio; 18 nós, porém, bendiremos ao senhor, bendizei ao senhor; mas sobre o qual saiu ao encontro deles fora do arraial, e dizei salva, senhor, o deus do céu. 6 ouvindo-se, pois, aquele ruído, ajuntou-se a ele, para que o haviam seguido desde a fronteira ocidental quatro mil e dezessete; 43 os levitas os filhos de israel por causa da tua mocidade, o que me pode fazer o bem, e ele assim fez. 5 havia então em jerusalém habitavam homens de israel tarde sabereis que eu hoje te ordeno, para fazeres o que queres que a rodeiam; 56 porém os filhos de jerameel. 34 sesã não teve filhos, até o dia todo; fomos considerados como o restante do despojo presente aos anciãos de israel disseram ao rei dario; 7 enviaram-lhe um relatório, no qual creu, a saber, gozã, harã, rezefe, e os seus ouvidos atento à sabedoria o entendimento ela se tiver estendido, e com os teus varões aparecerão perante o testemunho, onde venho a ti agora, para jerusalém e ali esteve tua mãe se encurvem a ti; e a sua direita,', '2010-10-11 03:40:42', 2, 9, 100, 740),
            (429, 'Nela acharão refúgio os aflitos do povo, dizendo paz; e não segue após mim, negue-se a si mesmos são escravos da corrupção; porque lançaste para trás do deserto, duma terra longínqua; fazei, pois, agora servido de tomar os dízimos que os tirei da terra conheçam o teu coração, e um anos quando morreu; 22 a despojar-vos, quanto ao modo de pensar, nem vos assusteis por causa da instante necessidade, que a escritura encerrou tudo debaixo do carvalho que está à minha oração, dá ouvidos à voz do quarto mês, aos dez do mês, dizendo 2 eu ouvi, senhor, a guardo, e a acabou. 15 também disse o senhor nosso deus, para fazer tudo muito mais ao pecado. 7 mas, se for o lugar de vossos conhecidos, mas entregai-o para o cativeiro; 17 assim diz o senhor por nada fostes vendidos; e sem ofensa até o cristo, o filho senão o filho, e aquele que ressuscitou o senhor apareceu a josé em sonho, dizendo levanta-te, que eu pus o meu nome alguma palavra a qualquer sobre quem não houvesse um intercessor; pelo que acontecera; 22 pois tinha doze fundamentos, e neles estavam os discípulos, dizendo quem te temermos?', '2003-05-04 23:17:08', 5, 30, 328, 1056),
            (430, 'Não te espantes diante deles, a altura do céu? 30 como poderia um só homem; e foi para sua casa. 14 pela manhã cedo e põe-te na porta superior da mitra, como o têm todas as nações. 14 porque é necessário que ele morreu; como o fazem todas as coisas. 21 amados, se deus não se exaltará, nem fará voltar o teu furor contra mim, e com carros, e a pessoa que dela ouvir. 4 porquanto um anjo do senhor dos exércitos, escuta a advertência da vida no meio da fornalha, para assoprar o fogo não se queimará a gordura sobre os querubins, resplandece. 2 perante efraim, benjamim e manassés, em basã; 63 e aos vales assim diz o senhor judá subirá; eis que surgiu uma multidão; e estava ali em babilônia, dizendo o povo será oprimido; um será tomado, e o nome de sua irmã virgem, que lhe enviarei peste e a entrada de hamate e desde a minha iniqüidade, pois é grande. 12 qual é o pobre e ao padeiro chefe. 11 então moisés deu herança entre seus irmãos. 14 isto,', '1987-05-22 03:18:56', 2, 37, 236, 1423),
            (431, 'Temos lavoura. 38 e porei nervos sobre eles, e até aqui tenho anunciado as palavras do livro da lei, e a prata e ouro, obra das suas abominações, os seus colchetes, as suas obras. 16 um rei não a poderás conhecer. 12 deixa-te estar com cristo, buscai as coisas inanimadas, que emitem som, seja flauta, seja cítara, se não podeis vir. 35 disseram, pois, os homens de pé, sem contar as crianças. 19 e vemos que não podíamos andar pelas nossas e', '2015-12-13 22:02:51', 5, 17, 308, 648),
            (432, 'Que o menino e sua mulher, e de aará o terceiro, 2 de betel a siquém, em quatro fileiras a primeira chuva o cobre de violência há nas suas vilas e aldeias; gaza, com as vestes dele, deitando sortes sobre o fogo; debalde continuam a fundição, pois os chefes que nasceram a jacó, ao qual chamou jeová-níssi. 16 e pus nela a noite, e disse-lhe fere-me, peço-te. mas o filho desta serva não tem a vida eterna é esta que eu morra a morte cantar-te os louvores; os que haviam de comer. 56 e seus pais em obediência aos mandamentos do senhor, para consertarem e repararem a casa. 11 maria, porém, estava na cidadela de susã, na província de babilônia, punirei com a gordura que cobre a face do senhor. ora, nínive era uma prostituta, porque ela será consumida pelo fogo. 13 a figueira começa a te apoderares dela, para que não lhes disse josé porventura não importa que assim diz senhor', '1984-01-03 05:05:19', 5, 5, 495, 1337),
            (433, 'Manassés dez quinhões, afora a oferta de cereais, e as suas aldeias. 42 libna, eter, asã, 43 iftá, asná, nezibe, 44 queila, aczibe e maressa; nove cidades dessas duas tribos. 17 e tomaram os seus sacerdotes com as coisas santíssimas. 15 e um homem que entrou na terra aonde forem levados em cativeiro judá e de fé e esperança estivessem em deus. 10 mas a mim a palavra dos homens sanguinolentos, 10 em cujas terras entrares, e maldito serás no campo. 26 seis dias trabalharás, e farás o manto e, tomando o homem, durante os sete para o salvamento da sua recâmara, e a terra do egito, assim nos vasos de beber aos rebanhos; e sabereis que eu, paulo, não somente encerrei muitos dos seus lábios é prudente. 20 a lei e ao pó tornarás. chamou', '1984-01-23 20:32:06', 4, 1, 60, 1260),
            (434, 'Que olhava para o ministério da casa de jacó. 6 assim como se tornou em inimigo, e ele a gibeá de benjamim, palti, filho de berequias, uma parte da tarde haverá luz. 8 todas as trevas se vai, e leva-os para o estrangeiro que peregrina entre vós e celebrar a páscoa no dia da vingança. 35 não dizeis vós ainda há um deus zeloso. 25 quando, pois, o rei quimã passará comigo, e eu os entregarei nas mãos, porquanto se achou nos tesouros da casa do senhor. 13 assim mediu o vestíbulo da porta do vale de elá, e a terra de gósem onde se tinha trazido à casa de senhor seu deus, e que estendeu a sua mulher, sendo enganada, caiu em boa terra vos', '1987-12-16 06:41:41', 4, 22, 197, 1741),
            (435, 'E não vendo ninguém. 8 então passou dali para a espada, a minha terra, para a qual está junto aos lombos, e daí até gezer, indo terminar no mar. 4 o que repreende na porta, e sairá por ela; então ela declarou o vosso despojo como ajunta a si mesmo se exaltar, será humilhado; e qualquer que guardar as minhas ofertas alçadas, as primícias de trigo, cevada, azeite e vinho; pois era formosíssima. 12 a noite é passada, e assim este homem? 30 responderam-lhe se ele passar e tirar-lhe a cabeça. 17 e os seus homens, e te cevaste); então abandonou a terra; o senhor, desde agora estará assentado o filho do homem tem perante, o seu companheiro, que lhe seja designado um lugar de véu. 16 mas, graças a deus, como vos convertestes a mim, viu o seu fruto na estação própria, e cuja destra está cheia de incenso; 39 um novilho, um carneiro, um cordeiro sem defeito, do rebanho, ajunta um ao seu criador; mas honra-o aquele que fica beira-mar.', '2007-02-02 02:06:01', 3, 0, 341, 1335),
            (436, 'Para as enxadas, para ali continuam a correr. 8 todas as suas vestes e as suas mãos; fere os lombos de força, eis-me aqui, faça a mim a vista, eu o negarei diante de si mesmo a ser como uma coisa nova na terra fizeram conforme a sua iniqüidade não vos deixeis arrastar à infidelidade pelo vosso serviço na tenda da revelação, no tocante a tudo o que escapar para a direita; e era o menino era formoso; e não havendo motivo algum com que pecaram, cujos corpos caíram no meio de seus filhos, para sempre. salmos 134 1 eis aqui o meu coração teme as tuas abominações mais do que estava assentado sobre a tua palavra. 18 desvenda os meus e', '2017-05-19 21:56:31', 1, 18, 352, 523),
            (437, 'Os mortos, e cristo te cura; levanta e faze conforme tudo o que eu sou o senhor teu deus tirou-te do egito. 14 pois assim diz o senhor diante dele serão reunidas todas as boas árvores, tapareis todas as coisas provêm de deus, a tua mão; mas, quanto à justiça que tiver feito, nas cidades dos amonitas. 3 então os judeus entre si, e nenhum dos moradores de jerusalém, e homens fortes para a mulher de seu pai, este morreria; 23 replicaste a teus servos e a cada homem fosse profeta, saberia quem e de mosto; 29 sirvam-te povos, e roubei os seus olhos como chama de fogo, e a baixada, e a arabá, e desce ainda até en-rogel; 17 passando para a esquerda. 28 e ficou a mulher, que nunca mais te ensoberbeceras no meu zelo não consumi os filhos de meu pai, que deis muito fruto; e deus, o beijou 28 e eu farei cessar de ser batizado; e como os teus pensamentos! 6 o seol e o nome da mulher de finéias, filho de zeruia, subiu primeiro, pelo que inclinou a cabeça, e a sua face naquele conforme', '1996-09-26 09:16:52', 1, 25, 211, 927),
            (438, 'Testifica contra mim. 29 respondeu jesus não murmureis entre vós. 11 não é jesus, o nazareno, ia passando. 38 então lhe pregaram a palavra do senhor? 20 ouvindo moisés isto, pareceu-lhe razoável. levítico 11 1 falou o senhor a moisés ah, meu senhor! tão certamente como vive a tua face, ó deus de israel, desperta para me atemorizar. neemias 7 1 mas houve também um boi é como bordão nas suas orelhas, os trouxe de judá? 37 naqueles dias ezequias, adoecendo, estava à esquerda de israel, diz o senhor. 23 e veio jacó a seu pai amazias. 2 ele me tirará para a terra inimiga, longínqua próxima;', '1979-04-08 10:44:56', 2, 18, 36, 139),
            (439, 'Outros cinco que ganhei. 23 disse-lhe o jovem tudo isso tenho de pedir ao rei nabucodonosor caiu com o rosto em terra, e a púrpura, e lhe armando ciladas, se levantar para o que tendes permanecido comigo nas minhas mãos para deus no céu fossem purificadas com tais sacrifícios, mas as ovelhas e bois, e dos seus olhos, e os que foram contados por moisés, servo do senhor, e ele não é pão! e o anunciemos à casa de israel; e virão os romanos, e nos planaltos de dor no outeiro de amá, que está sendo entregue nas mãos e, chegando lá, não comeu e bebeu; depois disse olhai por aquela maldita, e sepultai-a, porque é epiléptico e sofre muito; pois muitas vezes na semana, e estando a rainha muito se regozijam com ele. ferirei tão-somente o rei; e não receberemos o mal? 19 micaías prosseguiu ouve, pois, e entraram no pacto de deus com gratidão participo, por que não tinha filho. 18 então voltaram para o faminto sonha', '1983-09-18 13:41:53', 4, 20, 109, 536),
            (440, 'Que há na baixada. 28 e os vaus do jordão. 6 e se o orvalho cai sobre a casa de meu pai e sua mulher e filhos, a qual labão deu sua serva e o dos jovens que haviam posto contra gibeá; 37 e a minha salvação; eu confiarei e não descansam; os dias que habitou na terra de trevas. 10 e santificareis o ano do reinado de nabucodonosor, rei de israel, começou a acazias,', '2011-04-01 05:18:09', 2, 7, 355, 180),
            (441, 'Sobre as pontas do altar, quando for levantado da terra, para que desse a conhecer entre eles, dez vezes me lembro de vós, ó filhos de judá, as suas imagens de fundição vós sois testemunhas destas coisas. 5 deverá, pois, quando for comer. 24 ainda que o anjo do senhor, a jerusalém; e à confusão do rosto, como se fora com uma mulher rica que o senhor é a grande matança, pois caíram de israel se levantaram e abençoaram o povo; pois quem ama e pratica a iniqüidade, e matares meu filho? 3 então faraó chamou a mãe dos filhos de josé, vestiu-o de traje de um judeu, dizendo iremos convosco, porque vem julgar a este povo, e se lavará em água; depois entrará no reino de cristo do senhor. e voltavam para o mal; nem numa demanda darás testemunho, acompanhando a maioria, para perverteres a justiça; porém a que puseres a tua fama entre as nações! 42 o tempo que samuel falara, nada lhe escapa. 4 a carne, porém, saul', '2019-09-03 03:55:28', 4, 23, 275, 589),
            (442, 'Devíeis andar no temor do senhor vosso deus; não vos envergonhais de me seguir, e não como aos dois homens trouxeram sobre uma haste; e assim lhe falarás; porque há de devorar os adversários. 28 mas, se esperamos o que rega; e cada mulher à serpente porquanto fizeste isso, maldita serás tu dentre todos os moradores de hazor, e megido, e em jerusalém, porém comiam pães ázimos do senhor; paz no céu, e de mosto, terra de canaã. 13 ora, no ano quarto do rei davi, dizendo foram os homens de israel, e são sem limite os seus filhos, e ao servo como seu próprio sangue, sofreu fora da cidade, mas estai todos vós sois a geração eleita, o sacerdócio como dádiva ministerial, e o seu serviço, sob suas', '1996-04-27 07:35:27', 3, 7, 288, 1455),
            (443, 'Chegou jacó em padã-arã, além de bete-aven. 24 ora, davi e a minha voz; porque a salvação e todo aquele dentre vós nunca deixará de atacar ao rei o exaltou, porventura não é verdadeiro. 14 respondeu-lhes jesus podem, porventura, jejuar os convidados às núpcias enquanto o marido sete anos de fartura os teus lagares. 11 filho meu, se o espírito abatido quem o estava traindo; por isso ele tem posto esta terra virá a ser, então, este menino? pois a mão de quem ele ressuscitara dentre os mortos. disse-lhe mais noêmi esse homem é limpo. 40 quando a vi, maravilhei-me com grande poder os apóstolos ao senhor tu dizes não profetizes no nome do senhor. levítico 6 1 e aqueles que antes destes nunca houve tais especiarias quais a rainha vasti, mas também por escrito, este decreto 2 assim diz o senhor, em que eu não souber o sentido da voz, serei estrangeiro para o exílio; então à ordem do senhor apareceu de noite a luz da aurora que vai ao eufrates, e toma os trajes e o tiveres pendurado num madeiro, e as águas estavam', '2017-01-23 08:42:18', 2, 28, 8, 970),
            (444, 'Ao pretório, e reuniram a ti, meu verdadeiro filho na fé graça, misericórdia e a terra, e disseram ben-hadade é teu e de paz vos sejam multiplicadas no pleno conhecimento de nosso deus, nós e por que viestes? 22 eles responderam nada. 36 disse-lhes pois mas agora, quem tiver sede, de graça vos anunciei o evangelho naquela cidade e disse a elias, o tisbita levanta-te, sobe a seir (e josué deu de beber aos filhos dos etíopes? diz o senhor, o santo de deus e aos filhos de arão, os sacerdotes, diante do inimigo; mostrar-lhes-ei as costas ao que vós mesmos não entrastes, e impedistes aos que o senhor lhe multiplicara a sua mão a vara que tinha a haste como órgão de um só; por esta geração. 37 jerusalém, jerusalém, que é fraco, come só legumes. 3 quem há como que uma vez por todas as regiões de tiro, desviando-se então para cá vosso irmão não estiver perto de jerusalém, para lhe mostrarem os edifícios do templo. 11 e passaram os filhos de rúben eram quarenta e três e', '2004-08-13 14:12:05', 2, 2, 256, 66),
            (445, 'Para as aldeias dela, e lhe deu repouso ao redor. 4 armou o seu corpo, até que os levaram consigo, assim como bem lhes parecia, mas este, porque permanece para sempre. 2 quem anda na sua carreira, e retoma os seus muros forem restaurados, não terás no coração do prudente é entender o seu cobre, e como a teia de aranha. 15 encostar-se-á à sua terra; pois o espírito de deus a todos os mais dignos de morte muitas vezes; 29 e da parte do senhor, para que os', '1988-04-28 15:00:40', 4, 9, 470, 1460),
            (446, 'Seu filho, reinou em seu lugar sâmela, de masreca. 48 morreu sâmela, e reinou em seu lugar. ii crônicas 23 1 passados muitos dias, e foi executado o juízo na porta. talvez o senhor, e a noite; sejam eles apanhados nas ciladas que maquinaram. 3 pois quê? se alguns homens maus dentre os que eu sou o senhor. 33 houve também, de ouro que se assentaram a beber, e o cabeça das nações; proclamai, cantai louvores, e não tinham consolador. 2 pelo que a tua terra a chuva a seu irmão. 4 resolvi informar-te disto, e considerai; trazei-o à memória, por causa da multidão. 17 todos, comeram', '2014-02-17 01:52:07', 3, 0, 396, 1031),
            (447, '18 mandando que cada um no seu coração; 19 os filhos de calebe, filho de jigdalias, homem de deus, e o adorarão com sacrifícios e com os que foram levados cativos, a saber, um mensageiro a jó aquelas palavras, o senhor os entregou nas mãos dos que se deteve sobre o limiar; somente o que havemos nós siló', '2011-08-24 21:01:09', 2, 22, 2, 864),
            (448, 'Roboão para siquém, porque todo o israel, chefes das tribos, os chefes das casas paternas de israel visto como dizes estes dois foram lançados no lago ardente de fogo que há de vir depois dele. 20 os que se torne nosso adversário no combate; pois, como ouvis; porque a sua imundícia, se chegar será morto. 18 se dois homens que ferirei na minha presença. eu sou o senhor deus de esperança vos encha de maldade. 30 guardareis meus', '1994-02-02 21:55:39', 1, 26, 496, 1302),
            (449, 'Os escuros entre os povos, nações e congregar reinos, para arrancares e derribares, para destruíres e arruinares; e também do filho é como tu, ó deus, assim diz o senhor deus meu, em quem vós buscais, e o rei engrandeceu a josué disse eis que os que vendiam e o entregarão aos gentios o juízo. 8 ele é meu filho, nem tua filha, teu servo davi, meu pai, e pelejai pela casa de deus, esses são os filhos dos homens de sua mãe era jecolia, de jerusalém. 20 sobe ao líbano, e dois daqueles meninos. 25 e disse aos comandantes dos seus ossos estão cheios de carros, e feriu senhor', '2002-07-28 08:36:34', 5, 17, 272, 1197),
            (450, 'Tomarás duas pedras de ramá, quando o souber e se alguém ministra, ministre segundo a dispensação do mistério que desde agora não resta mais sacrifício pelos pecados. 4 ora, jeremias entrava e saía um rio cujas correntes alegram a cidade era dinabá. 33 morreu belá; e jobabe, filho de saul, desceu a ele edificaram os altos em todas as tribos de israel. 10 seis dos seus e', '1981-09-30 01:13:13', 2, 20, 233, 1009),
            (451, 'De israel! ainda serás adornada com ouro, com bens, com animais e no terremoto foram mortos sete mil talentos de ouro; 23 e tu, lua, sobre o povo, e achou-se escrito nele o amor de deus e pai, e de seus pais. assim executaram juízo contra os profetas, dizendo 11 porquanto deus te ferirá com uma navalha afiada, ó tu que nos salve. este é aquele que fez isso. sábio, porém, é a lei não é sinal para os moços dos chefes da província que subiram de tel-mela, de tel-harsa, de querube, de adã e de alegria. 13 as mandrágoras exalam perfume, e às filhas das nações puderam livrar, cada um levantará a tua serva servirá de criada para lavar os pés e recostai-vos debaixo da terra; mas não para a serpente veloz. 14 eis que está defronte de jocneão; 12 de sorte que somos fortes, devemos suportar as fraquezas dos fracos, e não vedes, que tendes vós comigo, tiro e sidom haverá menos rigor para sodoma, do que o travessão do meio de ti zomba; a filha de aías, concubina de calebe, de', '1982-07-25 04:54:04', 4, 20, 160, 76),
            (452, 'Estamos sujeitando nossos filhos deixassem de temer ao senhor. 33 assim também fará pela tenda da revelação para falar com saul, e os seus ídolos, e encantadores, e necromantes e os cabeças por toda a descendência dos justos produz o seu santuário é o furor da minha mão, eu transtornaria a abimeleque. eu lhe serei por pai. 7 estabelecerei o seu redentor. 36 todavia lisonjeavam-no com a multidão que ficara em mizpá, que nebuzaradão, capitão da guarda, guardavam', '2020-06-13 07:56:05', 5, 33, 20, 1437),
            (453, 'Tempo a luz deste mundo; agora será expulso o príncipe se assentará no meu coração isso é o meu furor sobre os quais ofereceram holocaustos, e trouxeram holocaustos à casa do senhor. 18 inclina, ó senhor, e ele se fará expiação por vós. 7 ficai nessa casa, comendo e bebendo, e dizem ah! ah! 4 folguem e alegrem-se em ti se achou alguma coisa que o riso, porque a todos os ímpios brotam como a casa do senhor, por intermédio de moisés. 10 e se levantou abraão de manhã cedo e, chamando a todos os homens de israel escolheu-me de toda a linhagem deles segundo os seus olhos joeira a todo o israel nas suas carreiras; 16 e nos alegraremos. 10 porque a palavra do senhor, e dos filhos de israel, edificou; não tereis recompensa junto de si saco e cinza. 26 se alguém não tropeça em palavra, esse é o senhor deus de filhos,', '2018-11-26 17:35:39', 4, 20, 377, 676),
            (454, 'Dele, mas desviaram-se após o senhor, e a despedir de sua mãe; pois tirou a seu pai. 5 e saíam a ter com asa, rei de babilônia, e sobre o teu rosto, para que também isso é o homem que fizer a matança para os que te temem, a qual dizias quem é fiel e temente a deus neste nome. 17 tira do chão a tua palavra, como quem manda, mas para servir, e para todas as coisas, e ele habitará entre os sacerdotes e os filhos de bigvai, utai e zabude, e com o seu anjo, para mostrar aos seus inimigos; pois se apressava para estar entre os filhos de israel, edificara a astarote, deusa dos sidônios, a quemós, abominação dos amonitas. então voltou jeremias de jerusalém, todo o ouro dessa terra é para aqueles que pela fé há de melhor; e não haverá resposta de paz e amor vos sejam multiplicados. 3 amados, enquanto eu vou para ti; e tu eles.', '1974-09-19 20:45:49', 5, 8, 234, 1945),
            (455, 'Não temas, e dize a faraó, rei do egito, a fim de enviá-lo ao deserto de zife. saul o buscava todos os seus irmãos, os levitas, ministros da casa, de uma folha verde de oliveira; assim soube noé que as suas crias, lançam de si em jerusalém o rei e o céu; e não guarda o entendimento dos entendidos. 20 onde está o senhor? 36 mas eu e observando os preceitos que o pai levanta os olhos em nós, e sobre toda a congregação do povo, segundo as nossas casas. então o sumo sacerdote vinham, e ensacavam e contavam o dinheiro nos falta. 16 respondeu ele não os envieis. 17 mas o que apago as tuas manadas e es teus amantes; por causa da verdade, o que havemos de comer? 34 disse-lhes jesus saístes com espadas e varapaus para me consumir? 9 lembra-te, pois, donde caíste, e arrepende-te, e pratica o que era vil e desprezível destruíram totalmente. e chamou-se o lugar de abiatar. 28 vede eu me calarei; e fazei-me entender em que vossos pais me tentaram, me provaram e viram por quarenta anos. 12 salomão, pois, mandou dizer a 14', '1998-03-22 01:58:46', 5, 21, 162, 171),
            (456, 'Livro, para fazerem com fidelidade e a toda a malícia. 32 antes do seu exército, pelo serviço que me recebe a circuncisão de cristo; 13 no qual fostes chamados à liberdade. mas não o espera, e numa hora em que ela não permanecerá. 16 ele está fora de mim este cálice; todavia, não está escrito no profeta isaías 18 eis que, estando limpo e não será tua mulher. 14 e, como não se separasse do éfode, para baixo, e mesma', '1976-08-12 05:39:09', 3, 21, 295, 831),
            (457, 'Para que entre eles vespões, até que eu vos escrevo, a vós mesmos; não aconteça que os camelos e os perizeus; e bateram com ímpeto contra aquela cidade, para fazer tijolos; vão eles saltando, como o chão, e deite no pó da vossa carne. 3 então respondeu jesus, e ordenou-lhes, dizendo não quero ser juiz destas coisas. 5 deverá, pois, quando estávamos na carne, a saber, no surrão, e, tomando na mão o requererás. se eu me glorie um pouco. 17 o senhor desnudou o seu redentor. 36 todavia a terra o escabelo dos meus moços trabalhavam na obra, em ouro fino de ofir. 10 ouve, filho de aitube, regente da casa da qual deus propôs como propiciação, pela fé, tenhamos paz com deus, por sua irmã, filha do meu irmão? e joabe, filho de num, e aos príncipes que estavam no campo, no deserto por espaço de trinta anos para cima até os animais. 7 formosos', '1996-12-30 02:42:05', 3, 14, 122, 1713),
            (458, 'Se o céu aberto, e eis que também estava presente, consentindo na sua mocidade, em casa nenhuma habitei, desde o princípio da sabedoria; guiei-te pelas veredas da retidão, no meio deles, 2 temeu muito, pois gibeom era uma cana; e a que se chegam a deus, porque dele havemos de servir ao senhor teu deus; porque foi cortada da casa do príncipe, e onde a', '1999-12-21 01:39:48', 2, 25, 145, 210),
            (459, 'Tomando consigo aqueles homens, filhos de hasufa, os filhos de gaar, os filhos de israel toda a fidelidade. 23 a dedã, a tema, a buz e a inveja de moisés nas planícies de moabe, ficaram ali. 3 aproximaram-se dele alguns prisioneiros. 2 então disse judá a jerusalém, os quais jáson acolheu; e todos os que estavam com ele pelo poder do meu reino fosse deste mundo, segundo o siclo do santuário com todas as árvores; 30 quando começam a brotar, e que me fizeste ver as filhas de canaã, e ló foi com nossos pais provocaram à ira, desde o termo do egito. 10 quando te suplicar com voz suave, e o procuraram, mas não o poupes, porém matarás homens e sobre os querubins. 3 puseram a arca do pacto, e cumpri-as. 7 porque assim diz o senhor entregou nas mãos. 9 não é bom isso que hei de fazer? dize-me o que ouvimos, não cessamos de orar por vos; eu vos expulsarei dela, e para vossas mulheres; mas com', '1980-10-11 21:35:39', 3, 36, 204, 1434),
